INSERT INTO `flight_airlines` VALUES (1,'Biman Bangladesh Airlines','Shahjalal International Airport','Dhaka','Biman_Bangladesh_Airlines_logo.png','Biman_Bangladesh_Airlines_logo.png','BG','BBC','Bangladesh Biman Airlines','2011-10-10 07:06:53',1,'2014-01-27 11:25:29','2014-09-24 09:31:18'),(2,'Saudi Arabian Airlines','King Abdulaziz International Airport','Jeddah','saudi-arabian-airlines-logo.png','saudi-arabian-airlines-logo.png','SV','SVA','Saudi Arabian Airlines','2011-10-10 07:14:49',1,'2014-01-27 11:25:29','2014-09-24 09:31:24'),(3,'Air Canada','Calgary International Airport','Calgary','Air Canada Logo.jpg','Air Canada Logo.jpg','AC','ACA','Air Canada  is the flag carrier and largest airline of Canada\\\'. The airline, founded in 1936, provides scheduled and charter air transport for passengers and cargo to 178 destinations worldwide.','2011-10-11 10:30:34',1,'2014-01-27 11:25:29','2014-09-24 09:31:16'),(4,'Air Labrador','Goose Bay Airport','Goose Bay','Air Labrador Logo .jpg','Air Labrador Logo .jpg','WJ','LAL','Labrador Airways Limited, operating as Air Labrador, is a regional airline based in Goose Bay (CFB Goose Bay), Newfoundland and Labrador, Canada. It operates scheduled daily passenger and freight services throughout Labrador and Quebec, as well as charter operations with the options of landing in remote and off strip destinations with skis, wheels and floats.','2011-11-16 08:16:16',1,'2014-01-27 11:25:29','2014-09-24 09:31:16'),(5,'Air Nova','Halifax, Nova Scotia','Halifax','Air Nova Logo.jpg','Air Nova Logo.jpg','','ARN','Air Nova was an airline based in Enfield, Nova Scotia, Canada that became part of Air Canada Regional in 2001. In 2002 the merger of Air BC, Air Ontario, Air Nova and Canadian Regional Airlines was finalised with the launch of a new name and brand-Air Canada Jazz.','2011-11-16 08:29:46',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(6,'Air Ontario','Toronto Pearson International Airport','Toronto','Air Ontario Logo.jpg','Air Ontario Logo.jpg','','ONT','Air Ontario Inc. was established in June 1987, with the merger of Austin Airways, Canadas oldest airline, which began service in 1934, and Air Ontario Ltd. (formerly Great Lakes Airlines, formed in 1958).','2011-11-16 08:56:55',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(7,'AirTran Airways','Baltimore-Washington International Thurgood Marshall Airport','Baltimore-Washington','Air Tran Logo.jpg','Air Tran Logo.jpg','FL','TRS','AirTran Airways, a subsidiary of the Dallas, Texas-based Southwest Airlines[4], is an American low-cost airline headquartered in Orlando, Florida.[5] AirTran operates over 650 daily flights (as of September 2011), primarily in the eastern and midwestern United States.','2011-11-16 09:12:28',1,'2014-01-27 11:25:29','2014-09-24 09:31:17'),(8,'Air Transat','Montreal-Trudeau Int\\\'l Airport Toronto Pearson Int\\\'l Airport','Montreal-Trudeau','Air Transat Logo.jpg','Air Transat Logo.jpg','TS','TSC','Air Transat is an airline based in Saint-Laurent, Montreal, Quebec, Canada,[3] operating scheduled and charter flights, serving 60 destinations[4] in 25 countries. The airline is owned and operated by Transat A.T. Inc.','2011-11-16 09:41:46',1,'2014-01-27 11:25:29','2014-09-24 09:31:17'),(9,'Alaska Airlines','Portland International Airport','Portland','Alaska Airlines Logo.jpg','Alaska Airlines Logo.jpg','AS','ASA','Alaska Airlines (NYSE: ALK) is an airline based in the Seattle suburb of SeaTac, Washington in the United States. The airline originated in 1932 as McGee Airways. After many mergers with and acquisitions of other airlines, including Star Air Service, it became known as Alaska Airlines in 1944.','2011-11-16 09:59:27',1,'2014-01-27 11:25:29','2014-09-24 09:31:17'),(10,'Aloha Airlines','Honolulu International Airport','Honolulu','Aloha Alir line Logoq.jpg','Aloha Alir line Logoq.jpg','KH','AAH','Aloha Airlines was an American airline headquartered in Honolulu CDP, City and County of Honolulu, Hawaii,[2] operating from a hub at Honolulu International Airport. Operations began on July 26, 1946, and ceased on March 31, 2008.','2011-11-16 10:10:57',1,'2014-01-27 11:25:29','2014-09-24 09:31:17'),(11,'American Airlines','Dallas/Fort Worth International Airport','Dallas/Fort Worth','American Express.jpg','American Express.jpg','AA','AAL','American Airlines, Inc. (AA) is the world\\\'s fourth largest airline in passenger miles transported[5] and operating revenues. American Airlines is a subsidiary of the AMR Corporation and is headquartered in Fort Worth, Texas adjacent to its largest hub at Dallas/Fort Worth International Airport. American operates an extensive international and domestic network, with scheduled flights throughout North America, Latin and South America, Europe, Asia/Pacific and the Caribbean.','2011-11-16 10:41:14',1,'2014-01-27 11:25:29','2014-09-24 09:31:17'),(12,'ATA Airlines','Chicago Midway International Airport','Chicago Midway','ATA line Logo.jpg','ATA line Logo.jpg','','AMT','ATA Airlines, Inc., formerly known as American Trans Air, was an American low-cost scheduled service and charter airline based in Indianapolis, Indiana.[1] ATA operated scheduled passenger flights throughout the US mainland and Hawaii, as well as military and commercial charter flights around the world. The airline maintained focus cities at Chicago Midway International Airport, Honolulu International Airport, and Oakland International Airport.','2011-11-16 10:52:54',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(13,'America West Airlines','Las Vegas McCarran International Airport','Las Vegas McCarran','American West Airline Logo.jpg','American West Airline Logo.jpg','US','AWE','America West Airlines corporate offices were in Tempe, Arizona and the main hub was at Phoenix Sky Harbor International Airport. The airline became part of the US Airways Group after a merger in 2005.','2011-11-16 11:06:59',1,'2014-01-27 11:25:29','2014-09-24 09:31:25'),(14,'Amerijet International','Miami International Airport','Miami','Amerijet Int.Logo.jpg','Amerijet Int.Logo.jpg','M6','AJT','Amerijet International is an American cargo airline headquartered in Fort Lauderdale, Florida, United States.[1] It operates all-jet cargo services to destinations in Central America, South America and the Caribbean. Its main base is Fort Lauderdale-Hollywood International Airport, with a hub at Miami International Airport.','2011-11-16 11:24:36',1,'2014-01-27 11:25:29','2014-09-24 09:31:17'),(15,'Atlantic Coast Airlines','Dulles International Airport','Dulles','Atlantic Coast Airlines logo-1.jpg','Atlantic Coast Airlines logo-1.jpg','','BLR','Atlantic Coast Airlines was an airline based in the United States owned by Atlantic Coast Holdings, Inc.. It operated as United Express for United Airlines and Delta Connection for Delta Air Lines. It was headquartered in the Dulles area of unincorporated Loudoun County, Virginia, United States.','2011-11-16 11:36:43',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(16,'Atlas Air','Miami International Airport','Miami','Atlas Air.jpg','Atlas Air.jpg','5Y','GTI','Atlas Air, Inc. is an American cargo airline based in Purchase, Harrison, New York.[3] It operates scheduled freight flights on a wet lease basis for some of the world\\\'s leading airlines, flying to 101 cities in 46 countries.[4] Its crew bases include: Miami International Airport, New York\\\'s John F. Kennedy International Airport, Los Angeles International Airport, Anchorage International Airport, Houston\\\'s George Bush Intercontinental Airport, and Huntsville International Airport. The parent company is Atlas Air Worldwide Holdings, Inc. (AAWW).','2011-11-16 12:03:35',1,'2014-01-27 11:25:29','2014-09-24 09:31:17'),(17,'Big Sky Airlines','Billings Logan International Airport','Billings Logan','Big Sky Airlines.jpg','Big Sky Airlines.jpg','','BSY','Big Sky Airlines was an American regional airline that operated from 1978 to 2008. Headquartered in Billings, Montana, United States.[1] Big Sky was wholly owned by Big Sky Transportation Company, a wholly owned subsidiary of MAIR Holdings.','2011-11-17 03:57:38',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(18,'Calm Air','Thompson Airport Winnipeg Airport','Thompson','Clam Air Logo.jpg','Clam Air Logo.jpg','MO','CAV','Calm Air International LP. is an airline based in Thompson, Manitoba, Canada and is presently owned by the Exchange Income Corporation. It operates services in northern Manitoba and the Kivalliq Region of Nunavut. Charter and freight services are also undertaken. Its main base is Thompson Airport.','2011-11-17 04:11:46',1,'2014-01-27 11:25:29','2014-09-24 09:31:18'),(19,'Canadian Airlines International Lignes aeriennes Canadien International','Calgary International Airport','Calgary','Canadian Airline Logo.jpg','Canadian Airline Logo.jpg','','CDN','Canadian Airlines International Ltd. was a Canadian airline that operated from 1987 until 2001. The airline was Canada\\\'s second largest airline after Air Canada, and carried more than 11.9 million passengers to over 160 destinations in 17 countries on five continents at its height in 1996. Canadian Airlines served 105 destinations in Canada, more than any other airline.','2011-11-17 04:25:10',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(20,'CanJet Airlines','Montral- Trudeau International Airport','Montral- Trudeau','Canjet airline.jpg','Canjet airline.jpg','C6','CJA','CanJet Airlines is a low-cost chartered airline based in Enfield and in the Halifax Regional Municipality, Nova Scotia, Canada at the Halifax International Airport.[1][2] It operates contract and ad hoc charters throughout Canada and the United States. CanJet is wholly owned by IMP Group International and has 572 employees (as of March 2007)','2011-11-17 04:35:23',1,'2014-01-27 11:25:29','2014-09-24 09:31:18'),(21,'Champion Air','Minneapolis-Saint Paul International Airport','Minneapolis-Saint Paul','Champion Air.jpg','Champion Air.jpg','','CCP','Champion Air was an airline based in Bloomington, Minnesota, USA. It operated general charter services to sports teams, vacation wholesalers and government agencies. It also offered limited scheduled service. Its main base was Minneapolis-Saint Paul International Airport, with hubs at Denver International Airport, Dallas-Fort Worth International Airport, Detroit Metropolitan Wayne County Airport, McCarran International Airport in Las Vegas, Lambert-St. Louis International Airport, and Will Rogers World Airport in Oklahoma City. The airline ceased all operations on May 31, 2008.[1] Until its shutdown, the airline was a prime contractor for the Justice Prisoner and Alien Transportation System.','2011-11-17 04:51:00',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(22,'Chautauqua Airlines','Chicago O\\\'Hare International Airport','Chicago O\\\'Hare I','Chautauqua Airlines logo.jpg','Chautauqua Airlines logo.jpg','RP','CHQ','Chautauqua Airlines, Inc. is a regional airline and a subsidiary of Republic Airways Holdings based in Indianapolis, Indiana, United States.[1] Based on 2009 published flight schedules, it operates scheduled passenger services on more than 700 flights daily to 98 airports in 31 states, Washington, D.C. and Canada through feeder services under the names AmericanConnection for American Airlines, Continental Express for Continental Airlines, Delta Connection for Delta Air Lines, Frontier Express for Frontier Airlines, US Airways Express for US Airways, and operated as United Express for United Airlines until January 2009, when the E145 agreement with United expired.','2011-11-17 04:57:48',1,'2014-01-27 11:25:29','2014-09-24 09:31:19'),(23,'Chicago Express Airlines','Chicago Midway Airport','Chicago','Chicago Express Airlines.jpg','Chicago Express Airlines.jpg','','WDY','Chicago Express Airlines, Inc. (IATA: C8, ICAO: WDY, Call sign: Windy City) was a regional airline headquartered in Chicago, Illinois, United States.','2011-11-17 05:04:38',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(24,'Colgan Air','Logan International Airport','Logan','Colgan Air.jpg','Colgan Air.jpg','9L','CJC','Colgan Air, Inc. is an American certificated regional airline subsidiary of Pinnacle Airlines Corp. The headquarters of Colgan Air are located in Memphis, Tennessee.','2011-11-17 05:11:09',1,'2014-01-27 11:25:29','2014-09-24 09:31:19'),(25,'Comair','Cincinnati-Northern Kentucky International Airport','Cincinnati-Northern Kentucky','Comair Airlines.jpg','Comair Airlines.jpg','OH','COM','Comair is a wholly owned subsidiary of Delta Air Lines headquartered on the grounds of Cincinnati-Northern Kentucky International Airport in unincorporated Boone County, Kentucky, United States, west of Erlanger, and south of Cincinnati, Ohio. Operating under the brand name Delta Connection, Comair operates passenger services to a large number of destinations in the USA, Canada, Mexico and the Bahamas.','2011-11-17 05:36:00',1,'2014-01-27 11:25:29','2014-09-24 09:31:19'),(26,'Continental Airlines','Antonio B. Won Pat International Airport (Guam)','Antonio B. Won Pat','Continental-Airlines.jpg','Continental-Airlines.jpg','CO','COA','Continental Airlines (IATA: CO, ICAO: COA, Call sign: CONTINENTAL) is a major American airline based in Chicago, Illinois (previously based in Houston, Texas). On May 3, 2010, Continental Airlines, Inc. and UAL, Inc. (the parent company of United Airlines) announced a merger via a stock swap, and on October 1, 2010, the merger closed and UAL changed its name to United Continental Holdings, Inc. These airlines are in the process of merging their operations under the name United Airlines.','2011-11-17 05:52:03',1,'2014-01-27 11:25:29','2014-09-24 09:31:19'),(27,'Corporate Express / Corporate Airlines / RegionsAir','Lambert-Saint Louis International Airport (American)','Lambert-Saint Louis','Corporate Air lines.jpg','Corporate Air lines.jpg','','CEA','RegionsAir was a Part 121[clarification needed] regional airline. Its headquarters and maintenance