o and passenger charter services. Its main base is Willow Run Airport, Ypsilanti.','2011-11-26 05:07:08',1,'2014-01-27 11:25:29','2014-09-24 09:31:22'),(268,'Trans States Airlines','O\\\'Hare International Airport','Chicago','Trans States Airline Logo.jpg','Trans States Airline Logo.jpg','AX','LOF','Trans States Airlines is the thirteenth largest[1] American regional airline and is headquartered in Bridgeton, Missouri.[2][3][4] It operates as United Express for United Airlines and US Airways Express for US Airways.','2011-11-26 05:41:14',1,'2014-01-27 11:25:29','2014-09-24 09:31:25'),(269,'UPS Airlines','Louisville International Airport','Louisville','UPS Logo.jpg','UPS Logo.jpg','5X','UPS','UPS Airlines is an American cargo airline owned by United Parcel Service Inc. (NYSE: UPS). The company is headquartered in Louisville, Kentucky.[5] Its home airport is located at Louisville International Airport. The pilots are represented by the Independent Pilots Association.','2011-11-26 05:52:26',1,'2014-01-27 11:25:29','2014-09-24 09:31:25'),(270,'Vanguard Airlines','Kansas City International Airport','Kansas','Vanguard Logo.jpg','Vanguard Logo.jpg','','VGD','Vanguard Airlines was an airline based out of Kansas City, Missouri. For a time, Vanguard also had significant operations at Chicago Midway International Airport in Chicago, Illinois, until late 2000. It ceased operations on July 29, 2002, after filing for bankruptcy.','2011-11-26 06:05:55',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(271,'Harlequin Air','Fukuoka Airport','Hakata-ku','Harlequin Airways Logo.jpg','Harlequin Airways Logo.jpg','','HLQ','Harlequin Air Co., Ltd. ( Hrekuin Ea?) was an airline with its headquarters on the grounds of Fukuoka Airport in Hakata-ku, Fukuoka, Fukuoka Prefecture, Japan.','2011-11-26 06:16:57',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(272,'Precision Air','Julius Nyerere International Airport','Tanzania','PrecisionAir Logo-1.jpg','PrecisionAir Logo-1.jpg','PW','PRF','Precision Air Services Limited, operating as Precision Air, is the largest airline in Tanzania, based in Dar Es Salaam.','2011-11-26 06:35:13',1,'2014-01-27 11:25:29','2014-09-24 09:31:23'),(273,'Zimbabwe Express Airlines','Harare International Airport','Harare','Zimbabwe Express Airlines Logo.jpg','Zimbabwe Express Airlines Logo.jpg','','EZX','Zimbabwe Express Airlines was an airline based in Zimbabwe. It was publicly owned and was the second airline in Zimbabwe to break the monopoly of Air Zimbabwe. It operated a Douglas DC-2010-32. Services included Harare to Bulawayo. However it eventually failed with economic problems.','2011-11-26 06:51:32',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(274,'Hokkaido International Airlines','Tokyo International Airport','Tokyo','Air Do Logo.jpg','Air Do Logo.jpg','HD','ADO','Hokkaido International Airlines ( Hokkaid Kokusai Kk Kabushiki-gaisha?), also known as Air Do ( Ea Du?) is a Japanese low-cost airline operating scheduled service between Tokyo and cities in Hokkaid.','2011-11-26 07:57:34',1,'2014-01-27 11:25:29','2014-09-24 09:31:20'),(275,'China Southern Airlines','Guangdong Province','Baiyun District','China Southern Airlines.jpg','China Southern Airlines.jpg','CZ','CZ','China Southern Airlines Company Limited is an airline headquartered in Baiyun District, Guangzhou, Guangdong Province, People\'s Republic of China.','2014-05-21 00:00:00',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(276,'Nepal Airlines Corporation','Tribhuvan International Airport','Kathmandu','Nepal Airlines.jpg','Nepal Airlines.jpg','RA','RA','Nepal Airlines is the flag carrier airline of Nepal. Its head office is in the NAC Building in Kathmandu, and its main base is Tribhuvan International Airport, Kathmandu. The airline was established in July 1958 as Royal Nepal Airlines Corporation.','2014-05-21 00:00:00',NULL,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(277,'Hong Kong Airlines','Hong Kong','Hong Kong','Hong Kong Airlines.jpg','Hong Kong Airlines.jpg','HX','HX','Hong Kong Airlines Ltd, IATA: HX, formerly CR Airways Limited, IATA: N8, is a Hong Kong-based airline, with its main hub and corporate head office at Hong Kong International Airport.','2014-05-21 00:00:00',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(278,'SpiceJet Ltd','Chennai, Tamil Nadu','Gurgaon, Haryana','SpiceJet.jpg','SpiceJet.jpg','SG','SG','SpiceJet is an Indian low-cost airline owned by the Sun Group of India. It has its registered office in Chennai, Tamil Nadu, and a corporate office in Gurgaon, Haryana','2014-05-21 00:00:00',1,'2014-01-27 11:25:29','2014-01-27 11:25:29'),(279,'Test','Test','Test','default.png','default.png','Test','Test','Test','0000-00-00 00:00:00',1,'2014-07-06 12:05:11','2014-07-06 12:05:11'),(280,'Jet Airways','Mumbai','Delhi','1411387104-KYDrk8x7vIFhDEcLY7oQ.png','1411387104-KYDrk8x7vIFhDEcLY7oQ.png','9W','JAI','Jet Airways is a major Indian airline based in Mumbai. It is the second largest airline in India, both, in terms of market share[6] and passengers carried, after IndiGo.','0000-00-00 00:00:00',14,'2014-09-22 11:26:38','2014-09-22 11:58:24'),(281,'Saurya Airlines','Tribhuwan International Airport','Kathmandu','1414907702-YmzlIQmWH5CZCPdHWvvo.jpg','1414907702-YmzlIQmWH5CZCPdHWvvo.jpg','SAU ','SAA','NEW JET PLANES','2010-10-20 14:00:00',1,'2014-11-02 05:55:02','2014-11-02 05:55:02');
