INSERT INTO `menus` VALUES (2,'package-tours','Package Tours','','2014-02-12 00:00:00','2014-03-02 07:44:54',0,1),(1,'/','Home','','2014-03-02 00:00:00','2014-03-02 07:43:58',0,1),(7,'contact-us','Contact','','2014-03-02 00:00:00','2014-03-02 07:45:07',0,1),(3,'hotels','Hotels','','2014-02-12 00:00:00','2014-03-02 07:44:57',0,1),(4,'vacation-rentals','Vacation Rentals','','2014-02-12 00:00:00','2014-03-02 07:44:59',0,1),(5,'vehicle-rentals','Vehicle Rentals','','2014-02-21 07:17:24','2014-03-02 07:45:01',0,1),(6,'flights','Flights','','2014-03-02 00:36:07','2014-03-02 07:45:05',0,1),(218,'Adventure','Adventure','Test No.1 Travel System .\r\n\r\n&lt;p&gt;Nepal is the most famous tourist destination for adventure sports and adventure tours in Asia. The Topography of this Himalayan Kingdom makes it the first choice for adventure tours. Let us have a look at the most thrilling , electrifying and mind blowing adventure places, sports and activities that Nepal offers.&lt;/p&gt;\r\n\r\n&lt;table align=&quot;LEFT&quot; border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; style=&quot;color:rgb(0, 0, 0); font-family:arial; font-size:13px; width:218px&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&nbsp;&lt;/p&gt;\r\n\r\n&lt;h1&gt;&nbsp;&lt;/h1&gt;\r\n\r\n&lt;div class=&quot;bdtxt&quot; style=&quot;color: rgb(38, 38, 38); text-align: justify; margin-right: 10px; line-height: 19px; margin-left: 220px; font-family: arial; font-size: 13px;&quot;&gt;&nbsp;&lt;/div&gt;\r\n','2014-11-02 05:19:32','2014-11-13 06:21:26',1,1),(216,'Activities','Activities','&lt;p&gt;The ultimate thrill of a bungee jump can now be experienced in Nepal &ndash; 12 km from the Nepal-Tibet border, a three-hour bus ride from Kathmandu. The bungee jump was designed by one of New Zealand&rsquo;s leading bungee consultants, and is operated by some of the most experienced jump masters in the business. The jump takes place from a 166 m wide steel suspension bridge that joins two sides of a deep valley over the raging Bhoti Kosi River. The place has spectacular scenery with dense forests covering the top of the cliff. One can overnight here and go rafting and rock climbing, too.&lt;/p&gt;\r\n','2014-08-21 04:39:36','2014-08-21 04:39:36',1,1),(217,'Trekking ','In The Nepal Himalaya(Trekking )','&lt;p&gt;Because of its elevation, Nepal can be divided into three zones &ndash; the high mountains, the mid-hills and the flat plains called the Terai. The Everest, Langtang and Annpurna trekking destinations in the mountains are cool throughout the year. The mid-hills, including Kathmandu and Pokhara, are cool except in the summer months from May to July. Temperatures in these cities during the summer remain much cooler than in many cities of the region. Lumbini, Chitwan and Janakpur in the Terai plains are hot in summer (March &ndash;July) but cold in winter (December-February).&lt;/p&gt;\r\n\r\n&lt;p&gt;So if you are going trekking, the best months for walking are between September and November and between February and May when the weather is fair during the day and the temperatures do not drop rapidly during the night.&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The year is divided into a wet season from June to September&mdash;as summer warmth over Inner Asia creates a low pressure zone that draws in air from the Indian Ocean&mdash;and a dry season from October to June as cold temperatures in the vast interior creates a high pressure zone causing dry air to flow outward. April and May are months of intense water stress when cumulative effects of the long dry season are exacerbated by temperatures rising over 40 &deg;C (104 &deg;F) in the tropical climate belt. Seasonal drought further intensifies in the Siwaliks hills consisting of poorly-consolidated, coarse, permeable sediments that do not retain water, so hillsides are often covered with drought-tolerant scrub forest. In fact much of Nepal&rsquo;s native vegetation adapted to withstand drought, but less so at higher elevations where cooler temperatures mean less water stress.&lt;/p&gt;\r\n\r\n&lt;p&gt;The summer monsoon may be preceeded by a buildup of thunderstorm activity that provides water for rice seedbeds. Sustained rain on average arrives in mid-June as rising temperatures over Inner Asia creates a low pressure zone that draws in air from the Indian Ocean, but this can vary up to a month. Significant failure of monsoon rains historically meant drought and famine while above-normal rains still cause flooding and landslides with losses in human lives, farmland and buildings. The monsoon also complicates transportation with roads and trails washing out while unpaved roads and airstrips may become unusable and cloud cover reduces safety margins for aviation. Rains diminish in September and generally end by mid-October, ushering in generally cool, clear, and dry weather, as well as the most relaxed and jovial period in Nepal. By this time, the harvest is completed and people are in a festive mood. The two biggest and most important Hindu festivals&mdash;Dashain and Tihar (Dipawali)&mdash;arrive during this period, about one month apart. The postmonsoon season lasts until about December.&lt;/p&gt;\r\n\r\n&lt;p&gt;After the postmonsoon comes the winter monsoon, a strong northeasterly flow marked by occasional, short rainfalls in the lowlands and plains and snowfalls in the high-altitude areas.In this season the Himalaya function as a barrier to cold air masses from Inner Asia, so southern Nepal and northern India have warmer winters than would otherwise be the case. April and May are dry and hot, especially below 1,200 meters (4,000 ft) where afternoon temperatures may exceed 40 &deg;C (100 &deg;F).&lt;/p&gt;\r\n','2014-08-21 04:41:07','2014-10-24 12:54:03',1,1);
