INSERT INTO `package_tours` VALUES (1,'Dubai Saver 3Night/ 4 Days',NULL,NULL,NULL,NULL,NULL,'Today, Dubai has emerged as a cosmopolitan metropolis that has grown steadily to become a global city and a business and cultural hub of the Middle East and the Persian Gulf region.','&lt;p&gt;&lt;strong&gt;Dubai&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Today, Dubai has emerged as a cosmopolitan metropolis that has grown steadily to become a global city and a business and cultural hub of the Middle East and the Persian Gulf region. Tourism is an important part of the Dubai government&#39;s strategy to maintain the flow of foreign cash into the emirate. Dubai&#39;s lure for tourists is based mainly on shopping,[ but also on its possession of other ancient and modern attractions. As of 2010, Dubai was the 7th most visited city of the world with 7.6 million visitors a year. Dubai is expected to accommodate over 15 million tourists by 2015.The emirate is also the most populous emirate of the seven emirates of United Arab Emirates. It is distinct from other members of the UAE in that a large part of the emirate&#39;s revenues are from tourism.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Itinerary: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Welcome to Dubai. Arrive at Dubai airport and Meet our local reprentative and transfer you to your hotel. You have the rest of the day at leisure. Overnight stay in Dubai.&lt;/p&gt;\r\n\r\n&lt;p&gt;After Breakfast proceed for a half day city tour of Dubai. The Visit most famous landmarks: photo stops for Dubai creek, Jumeirah Mosque, Jumeirah Beach, Burj Al Arab, Madinath Jumeira, Atlantis- the Palm, Sheikh Zayed Road. Later in the evening proceed for Dhow Cruise with buffet dinner at Dubai Creek. Experience cruising on a traditional wooden vessel surrounded by Arabic music and continental buffet dinner in the heart of Dubai creek. After dinner transfer to your hotel. Overnight stay at Dubai&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast in the Morning, you have leisure time till Afternoon; later in the afternoon proceed for your Desert Safari. Travel across the deserts of Dubai with several photo stops during an exciting dune drive to the first destination &ndash; a camel farm. The drive continues across the desert. Stop to watch the beautiful sunset before reaching the campsite, where you have the opportunity to do a camel ride, sand boarding (at additional cost). After working up an appetite, enjoy a delicious barbeque dinner followed by belly dancing performance. Back to Hotel.&nbsp; Over night at Hotel&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast check out form Hotel .Transfer to the airport for your onward flight or back home&lt;/p&gt;\r\n\r\n&lt;p&gt;Return air fare with fly Dubaior similar air line&lt;/p&gt;\r\n\r\n&lt;p&gt;Daily Breakfast at hotel&lt;/p&gt;\r\n\r\n&lt;p&gt;Desert safariwith Belly dance and barbeque dinner&lt;/p&gt;\r\n\r\n&lt;p&gt;Air port pick up and Drop in Sic Basis&lt;/p&gt;\r\n\r\n&lt;p&gt;Exclusions:&lt;/p&gt;\r\n\r\n&lt;p&gt;Surcharge for transfers between 2300 - 0730 hours&lt;/p&gt;\r\n\r\n&lt;p&gt;Peak Season Surcharges for Christmas,New Year &amp; Chinese New Year&lt;/p&gt;\r\n\r\n&lt;p&gt;Cost of foreign exchange for personal expenses&lt;/p&gt;\r\n\r\n&lt;p&gt;Expenses of personal nature, mini bar in the room, Laundry, telephone bills, tips, gratuities etc&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n','1411290795-iRydKL6Z5fYkwn93NfLI.jpg','1411290795-iRydKL6Z5fYkwn93NfLI_thumb.jpg',0,0,0,'',NULL,225,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,NULL,NULL,NULL,14,0,0,'2014-09-21 09:13:15','2014-01-23 01:49:17'),(2,'Amazing Thailand 4 Night/5 days',NULL,NULL,NULL,NULL,NULL,'Pattaya is a city in Thailand, a beach resort popular with tourists and expatriates. It is located on the east coast of the Gulf of Thailand, about 165 km southeast of Bangkok within','&lt;p&gt;&lt;strong&gt;Amazing Thailand 4 Night/5 days&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;(2 N Pattaya / 2N Bangkok)&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Fixed Departure on 11&lt;sup&gt;th&lt;/sup&gt; April &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Cost per person on Double Sharing Basis: NPR 59999/- &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Destination:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Pattaya: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Pattaya is a city in Thailand, a beach resort popular with tourists and expatriates. It is located on the east coast of the Gulf of Thailand, about 165 km southeast of Bangkok within but not part of Amphoe Bang Lamung in the province of Chonburi. &nbsp;Although Pattaya has become notorious as an adult playground for men, there are a few interesting attractions that can be enjoyed by couples and families. Like Alcazar Show, Noongh Nuch Village. Underwater world, beauty spa and lots of water sport activities on beach and Coral island which make perfect Getaways for short holidays&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Bangkok: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Welcome to Bangkok; cultural phenomenon, shopping heaven and tourist treasure, one of the most cosmopolitan, contrasting and, above all, compelling of Asian cities. A steamy, pulsating, yet smiling metropolis of more than ten million &ndash; intense at first, but addictive as anything. Come find your niche among dazzling temples, hotels of every breed and size, eclectic markets, gleaming palaces, ritzy shopping malls, a famous nightlife and the many things in between.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Details Itinerary:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 1: &nbsp;Arrive Bangkok and transfer to Pattaya Arrive &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Meal: Dinner&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Optional tours: Alcazar Show &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Welcome to Thailand!!! Once you arrive at Airport in Bangkok, you are met by our representative and transferred to your hotel in Pattaya. After check-in, while the rest of the day is free at leisure on your own. In the evening proceed for Alcazar Show - The largest Transvestite show (optional tours). Stay overnight at the Hotel in Pattaya.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 2: Pattaya &ndash; Coral Island tour with Lunch &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Meal: Breakfast / Lunch/ Dinner &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast, proceed for Coral Island Tour which includes Lunch. Coral Island is known for its turquoise blue and emerald green waters. View coral formations in breathtaking colors from a local glass-bottomed boat or you may even dive in and also enjoy various activities like snorkelling, swimming and sunbathing. Stay overnight at the hotel in Pattaya. Stay overnight at the Hotel / Resort in Pattaya.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 3: &nbsp;&nbsp;Pattaya &ndash; Bangkok &ndash; Temple and City tours &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Meal: Breakfast / Lunch/ Dinner &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After your breakfast in Pattaya. Check-out from the hotel and transfer to Thailand&rsquo;s pulsating city &ndash; Bangkok. Arrive Bangkok and later proceed for half day temple and city tour, which covers major landmarks including fascinating temples around the capital. Visit the Golden Buddha Temple (Wat Traimit), and the Reclining Buddha Temple (Wat Po). Stay overnight at the hotel in Bangkok.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 4: Bangkok &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Meal: Breakfast / Lunch/ Dinner &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Optional tour: Safari world with Marine Park tours &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast, today you have full day Free at Leisure for Shopping or proceed for Safari world with marine park tour with lunch. Which is an open air wildlife park, where one can drive through the park to experience close ups of all different type of animals. Later continue to the Marine Park to see amazing shows. World&rsquo;s most spectacular live action show, Ski Show Dolphin Show, Sea lion, Bird, Elephant and Orangutan shows, Hollywood cowboy stunt show. Stay overnight at the hotel in Bangkok.&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 5: Departure&nbsp; &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast, pick from the hotel to air port as per as per your flight&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Package inclusion:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Meet and Greet at Bangkok Air port on Arrival&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Return air fare with air fare taxes on Nepal air ways&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;2 Night accommodation at 3 Star City Center in pattaya&lt;/li&gt;\r\n	&lt;li&gt;2 Night accommodation at3 star city Center hotel in Bangkok&lt;/li&gt;\r\n	&lt;li&gt;Daily breakfast at hotel&lt;/li&gt;\r\n	&lt;li&gt;Coral island tours with lunch in Pattaya&lt;/li&gt;\r\n	&lt;li&gt;Half day City tours of Bangkok (4 Hr)&lt;/li&gt;\r\n	&lt;li&gt;02 Dinners in Local Indian Restaurant in Pattaya&lt;/li&gt;\r\n	&lt;li&gt;02 Lunch and 02 Dinners in Local Indian Restaurant in Bangkok&lt;/li&gt;\r\n	&lt;li&gt;Transfer from Bangkok air port &ndash; pattaya hotel- Bangkok hotel- Bangkok air port in SIC&lt;/li&gt;\r\n	&lt;li&gt;Menu (1 Dal , 2 Vegetable,1 Rita , Chicken Curry , Plain Rice , Nan , Roti , 1 Desert)&lt;/li&gt;\r\n	&lt;li&gt;Thailand visa cost&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Visa requirements:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;3 Recent Photographs&lt;/li&gt;\r\n	&lt;li&gt;Bank Statement (6 months transaction with 1Lakh)&lt;/li&gt;\r\n	&lt;li&gt;Passport with Validity for 6 months&lt;/li&gt;\r\n	&lt;li&gt;Relation Documents if family travelling together&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Flight Details:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;1 RA 401 H 14APR 1 KTMBKK DK1 1150 1615 14APR E 0 757&lt;/p&gt;\r\n\r\n&lt;p&gt;2 RA 402 H 18APR 5 BKKKTM DK1 1715 1930 18APR E 0 757&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Exclusions: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Overseas Travel Insurance change&lt;/li&gt;\r\n	&lt;li&gt;Surcharges applicable during Conventions, Special Events and Trade fairs&lt;/li&gt;\r\n	&lt;li&gt;Cost of Meals other than those specified in inclusions&lt;/li&gt;\r\n	&lt;li&gt;Cost of foreign exchange for personal expenses&lt;/li&gt;\r\n	&lt;li&gt;Early check-in and late check-out are on request basis only and subject to room availability&lt;/li&gt;\r\n	&lt;li&gt;Expenses of personal nature, mini bar in the room, Laundry, telephone bills, tips, gratuities etc&lt;/li&gt;\r\n	&lt;li&gt;Any increase in the cost that may come into force prior to the departure date including change in price owing to fluctuation in the rate of exchange.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n','1393829356-aauiw5cT0jSJyZNg9nOV.jpg','',0,0,0,'',NULL,213,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,NULL,NULL,NULL,1,0,0,'2014-08-21 10:51:43','2014-01-23 01:49:17'),(3,'Beautiful Malaysia 4 Night / 5Days',NULL,NULL,NULL,NULL,NULL,'Kuala Lumpur  KL to its friends  is more than just a capital city: it is a monument to Malaysian ingenuity and determination. From humble beginnings as a tin-mining shanty town, KL','&lt;p&gt;&lt;strong&gt;Beautiful Malaysia 4 Night / 5Days&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;(2 Night Kuala Lumpur /2 Night Genting Highlands)&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Destination:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Kuala Lumpur: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Kuala Lumpur &ndash; KL to its friends &ndash; is more than just a capital city: it is a monument to Malaysian ingenuity and determination. From humble beginnings as a tin-mining shanty town, KL has evolved into a 21st-century metropolis, dominated by the tallest skyscrapers in Southeast Asia and flush with the proceeds of international trade and commerce. Over the years, KL has faced its share of challenges but nothing has succeeded in suppressing the determination of locals to make KL, and Malaysia, a leader among Asian tiger economies.&lt;/p&gt;\r\n\r\n&lt;p&gt;The marketing slogan for the Malaysian tourist board is &lsquo;truly Asia&rsquo; and nowhere is this truer than in the capital. KL is every inch the Asian cyber-city: historic temples and mosques rub shoulders with space-age towers and shopping malls; traders&rsquo; stalls are piled high with pungent durians and counterfeit DVDs; and locals sip cappuccino in wi-fi&ndash;enabled coffee hops or feast at bustling streetside hawker stalls serving food from across the continent. The most striking thing about KL from a visitor&rsquo;s perspective is its remarkable cultural diversity. Ethnic Malays, Chinese prospectors, Indian migrants and British colonials all helped carve the city out of the virgin jungle, and each group has left its indelible mark on the capital. Eating, shopping and nightlife are undeniable highlights of any visit to KL, but don&rsquo;t restrict yourself to the city &ndash; there are numerous parks and monuments dotted around KL that make easy day trips for a break from the hustle and bustle.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Genting highland &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Genting Highlands otherwise known as Resorts World Genting is a hill resort in Malaysia developed by Genting Group.&lt;/p&gt;\r\n\r\n&lt;p&gt;One of the unique holiday destinations in Malaysia, Genting Highlands offers a cool climate two thousand metres above sea level, in the midst of a tropical rainforest. Many international tourist and Malaysian come to Genting Highlands for their summer holidays as well as weekend vacations. Genting offers a diverse travel experience with its many world class resorts and casinos, outdoor and indoor amusement parks, forest reserve, etc&lt;/p&gt;\r\n\r\n&lt;p&gt;The hill resort is at an average elevation of 1,740 metres (5,710 ft) within the Titiwangsa Mountains on the border between the states of Pahang and Selangor of Malaysia. Resorts World Genting is operated by Genting Malaysia Berhad (formerly known as Resorts World Bhd), which also operates Awana chain of resorts &amp; hotels. It is accessible by car from Kuala Lumpur in one hour, or also accessible by a cable car called Genting Skyway (3.38 kilometers (2.10 mi) which at its opening used to be the worlds fastest and South East Asia&#39;s longest gondola lift. Known as the &lsquo;Fun City above the Cloud&rsquo;, Genting Highlands is the only legal land-based casino, Casino de Genting, in the country and is owned by Genting Malaysia Berhad, a subsidiary of Genting Group&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Itinerary: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 1:&nbsp; Kuala Lumpur &ndash; Genting Highland &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Upon arrival at Kuala Lumpur International airport, meet and transfer to your Genting Highland Hotel &ndash; En- route visit Batu cave with one way cable car Ride. . Stay overnight First World Hotel or similar&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 2: Genting Highland &ndash; out door Theme Park &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After your breakfast in Genting Highland,&nbsp;&nbsp; Enjoy full day exploring the Genting Resorts and Get in to the Casino try some luck over there,&lt;/p&gt;\r\n\r\n&lt;p&gt;Also you can enjoy the outdoor and indoor theme park ride and activities inside the Genting highland, Evening at Leisure, over night at Genting Hotel.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 3: Genting Highlands &ndash; Kuala Lumpur &ndash; City tours of Kuala lampur &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast check out from the Hotel and proceed to kuala Lamur (1 1/5 Hr Drive), up on arrive at Hotel Check in to Hotel, in evening proceed to city of Kuala Lampur, Visit photo opportunities at the King&#39;s Palace, the Independence Square and Petronas Twin Tower&lt;/p&gt;\r\n\r\n&lt;p&gt;Learn about Malaysia&#39; history and culture on a visit of the National MuseumAdmire the elaborate structures of the National Monument, the National Mosque and the Kuala Lumpur Railway Station Walk through the Royal Selangor Visitor Center, see the flawlessly crafted pewter designs&lt;/p&gt;\r\n\r\n&lt;p&gt;Professional guide and hotel pickup and drop-off included. Over night at Kuala Lumpur Hotel&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 4: Kuala Lumpur -&lt;/strong&gt; &lt;strong&gt;Sunway Lagoon Theme Park Day Trip from Kuala Lumpur&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast, you have full day leisure or shopping. Or take optional tours of Sunway lagoon theme park and enjoy. Spend a day of family-friendly fun at one of Asia&#39;s top attractions! Enjoy rides and spills in the park&#39;s themed lands: World of Adventure, Wild Wild West, Waters of Africa, Extreme Park and Scream ParkGo surfing, float in river rapids, and catch street theater and dance performances Visit a leather and batik showroom and stop for a photo opportunity at Petronas Twin Towers on the way Over night at hotel at Kuala Lampur.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 5: Kuala Lumpur &ndash; Departure&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast&nbsp;&nbsp; you will be transfer to air port as per flight schedule. With unlimited memories of vacation.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Package inclusion:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Return air fare with air fare taxes on&nbsp; Malaysian&nbsp; air ways&lt;/p&gt;\r\n\r\n&lt;p&gt;2 night accommodation in Genting Highlands at first world Resort or similar&lt;/p&gt;\r\n\r\n&lt;p&gt;2 Night accommodation in Kuala Lumpur at Pearl international hotel or similar&lt;/p&gt;\r\n\r\n&lt;p&gt;Daily Breakfast at hotel&lt;/p&gt;\r\n\r\n&lt;p&gt;One way cable car with batu cave on the way to Genting highlands&lt;/p&gt;\r\n\r\n&lt;p&gt;outdoor and indoor theme&nbsp; Park ticket&nbsp; at Genting Highlands&lt;/p&gt;\r\n\r\n&lt;p&gt;Half day city tour of kuala lampur in SIC Basis&lt;/p&gt;\r\n\r\n&lt;p&gt;All Air port pick up and Drop , intercity transfer in SIC basis&lt;/p&gt;\r\n\r\n&lt;p&gt;Malaysian Visa Cost&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Exclusions: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Overseas Travel Insurance change&lt;/p&gt;\r\n\r\n&lt;p&gt;Surcharge for transfers between 2300 - 0730 hours&lt;/p&gt;\r\n\r\n&lt;p&gt;Surcharges applicable during Conventions, Special Events and Trade fairs&lt;/p&gt;\r\n\r\n&lt;p&gt;Peak Season Surcharges for Christmas,New Year &amp; Chinese New Year&lt;/p&gt;\r\n\r\n&lt;p&gt;Cost of Meals other than those specified in inclusions&lt;/p&gt;\r\n\r\n&lt;p&gt;Cost of foreign exchange for personal expenses&lt;/p&gt;\r\n\r\n&lt;p&gt;Early check-in and late check-out are on request basis only and subject to room availability&lt;/p&gt;\r\n\r\n&lt;p&gt;Expenses of personal nature, mini bar in the room, Laundry, telephone bills, tips, gratuities etc&lt;/p&gt;\r\n\r\n&lt;p&gt;Any increase in the cost that may come into force prior to the departure date including change in price owing to fluctuation in the rate of exchange.&lt;/p&gt;\r\n','1393830230-NUIDZargcI9XiYDgxWAB.jpg','',0,0,0,'',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,'2014-03-03 09:51:47','2014-01-23 01:49:17'),(5,'Singapore Gateways 3 Night/ 4Days',NULL,NULL,NULL,NULL,NULL,'Singapore is one of the most enjoyable cities in Southeast Asia. Few cities in Southeast Asia can boast Singapore\'s fascinating ethnic brew. Where else in the world can you dip into ','&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;Singapore is one of the most enjoyable cities in Southeast Asia. Few cities in Southeast Asia can boast Singapore&#39;s fascinating ethnic brew. Where else in the world can you dip into the cultures of China, India and Muslim Malaysia all in one day, against a backdrop of ultra-modern Western commerce.Not only has Singapore&#39;s history of migration left a rich cultural and architectural legacy that makes wandering the streets an absorbing delight, it has created one of the world&#39;s great eating capitals. But Singapore is not all about shopping and eating. Nor is the notion of Singapore as completely urbanised anything more than popular myth. Adventure activities include diving with sharks at Underwater World on Sentosa, mountain biking around Bukit Timah, leopard-spotting at Singapore Zoo&#39;s magical Night Safari, waterskiing or wakeboarding on the Kallang River, go-karting and rock climbing. And if you want to retreat from civilisation completely, the centre of the island retains large tracts of forest where the only sound you can hear is the monkeys swinging through the trees. In fact, Singapore is one of only two cities in the world that still retains a patch of primary rainforest, in the form of Bukit Timah Nature Reserve. It&#39;s a fascinating place - and a remarkable achievement., . You don&#39;t have to look far to find echoes of the islands colorful, rakish past, or evidence of a thriving and creatively unfettered artistic community. Singapore&#39;s soul is alive and well - and it is unique.&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;&lt;strong&gt;Day 1: Singapore &ndash; Arrive &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;Evening at Leisure, over night at Singapore Hotel.&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;After Breakfast Proceed to City tours of Singapore, our orientation tour of Singapore begins with a drive around the Civic District past the Padang, Cricket Club, Parliament House, Supreme Court and City Hall. You&#39;ll have great views of Marina Bay when you stop for photos at Merlion Park and the Merlion, Singapore&#39;s mythological creature that is part lion, part fish Etc, Later back to Hotel, and At Evening Proceed to Award-winning nighttime jungle safari by open tram also get chance to Close-up views of the animals on a guided trail walk with English-speaking licensed guide .Later come back to Hotel, over night at Singapore&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;After Breakfast, proceed to Sentosa Island. Spend full day exploring beautiful resort, enjoy one way cable car ride, Underwater World, sky ride etc, One of the over-rated show, Song of the Sea is a must-see water show by the sea located at Siloso Beach. Formerly known as Musical Fountain, it is a complete change after a major renovation. I used to end my trip with the show, where the hightlight is on fountain-like water spray dancing harmoniously with the background classical music. In addition, it was enhanced with colorful lighting which changes constantly with the rhythm of the background music Now filled with lasers, pyrotechnics, bursts of fire, water jets, pop music and a live cast, the show has become more like a state-of-the-art entertainment. I wasn&#39;t impressed with all the new additions. However, it&#39;s still a good experience if you have not yet seen it. &nbsp;And later in the Evening come back to Hotel, over night at Singapore&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;After Breakfast. Pick up form the Hotel as per your Flight schedule for on world journey.&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;Return air fare with air fare taxes on&nbsp; Malaysian&nbsp; air ways&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;Daily Breakfast at hotel&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;Singapore night Safari tours in SIC&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;Air port/ Bus Stop&nbsp; Pick up and Drop at Singapore in SIC&nbsp; Basis&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;&lt;strong&gt;Exclusions: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;Surcharge for transfers between 2300 - 0730 hours&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;Peak Season Surcharges for Christmas,New Year &amp; Chinese New Year&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;Cost of foreign exchange for personal expenses&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;Expenses of personal nature, mini bar in the room, Laundry, telephone bills, tips, gratuities etc&lt;/p&gt;\r\n\r\n&lt;p style=\\&quot;text-align: justify;\\&quot;&gt;&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;p style=&quot;text-align: justify;&quot; 0.25in;=&quot;&quot; text-align:=&quot;&quot; justify;\\\\&quot;=&quot;&quot;&gt;Any increase in the cost that may come into force prior to the departure date including change in price owing to fluctuation in the rate of exchange.&lt;/p&gt;\r\n','1393840648-hgSgQQLvRNnVXyTZR38u.jpg','',0,0,0,'',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,'2014-03-03 09:57:56','2014-01-23 01:49:17'),(6,'Hong Kong &ndash; Macau 5 Night/6Days',NULL,NULL,NULL,NULL,NULL,'Hong Kong is one of the two Special Administrative Regions of the People\'s Republic of China, the other being Macau. It is situated on China\'s south coast and, enclosed by the Pearl ','&lt;p&gt;&lt;strong&gt;Destination: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Hong Kong:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Hong Kong is one of the two Special Administrative Regions of the People&#39;s Republic of China, the other being Macau. It is situated on China&#39;s south coast and, enclosed by the Pearl River Delta and South China Sea,it is known for its expansive skyline and deep natural harbour . Hong Kong is a world city. It is one of the Al&shy;pha+ cities and it usually be considered as the fifth most important city in the world, after New York City, London, Paris and Tokyo. Also, a Time Magazine article in 2008 coined the phrase &quot;Nylonkong&quot;, which referred to New York City, London and Hong Kong, that these three cities form a global network that facilitates the global economyThe lack of space caused demand for denser constructions, which developed the city to a centre for modern architecture and the world&#39;s most vertical city .Hong Kong has numerous high international rankings in various aspects. For instance, its economic freedom, financial and economic competitiveness, quality of life, highly. Hong Kong has many nicknames, but the most famous is &quot;Pearl of the orient&quot; (Cantonese: Dong Fong Chi Chu). It was named according to the shiny city lights from both sides of Victoria Harbour and the high rise buildings. In addition, Hong Kong is also named as &quot;Golden Egg&quot;, &quot;The World&#39;s most vertical City&quot;, &quot;The orient Manhattan&quot;, &quot;The paradise of shopping&quot;, &quot;Food paradise&quot; and &quot;City of life&quot;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Macau:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Macau also spelled Macao, is one of the two Special Administrative Regions of the People&#39;s Republic of China, the other being Hong Kong. Macau lies on the western side of the Pearl River Delta across from Hong Kong to the east, bordered by Guangdong Province to the north and facing the South China Sea to the east and south. The territory&#39;s economy is heavily dependent on gambling and tourism, but also includes manufacturing. The Cantonese people from Hong Kong and Guangdong, especially recent mainland tourism from Mandarin-speaking regions, have boosted the economy of Macau significantly. A former Portuguese colony, Macau was administered by Portugal from the mid-16th century until late 1999, when it was the last remaining European colony in Asia. There are lot of actives in Macau which attract people from all around the world / Casino and Night life of the Macau is very famous in the World, come during your holidays don&rsquo;t forget to try your luck at local casino and enjoying night life of Macau city&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Itinerary: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 1: Hongkong &ndash; Transfer to Macau&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Wel come to Hong kong &amp; Macau!!!! Arrival at Hong Kong airport, Proceed to ferry terminal than you will be transferred to Macau by ferry. Check in at hotel and rest of the day is at leisure or explores the city. Evening Enjoy shopping or visit world famous casinos in Macau and try some luck over there, Back to Hotel overnight at Macau hotel.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 2: Macau&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast at hotel, proceed to for half day Macau city tour. Macau is best known for its casinos but there is much more to enjoy here it also offers the simple joy of sightseeing. Visit famous The Ruins of St Paul&#39;s Cathedral, Senado Square, The A-Ma Temple and Macau Observation tower. After the tour, we will take you to the local restaurant for lunch (included in package). Evening is free for relaxation or you can enjoy various activities such as gambling, shopping or leisure at the sea. Back to hotel Stay overnight at Macau hotel.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 3: Macau &ndash; Hong Kong&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;Breakfast at Hotel and check out from hotel and proceed for the transfer to dock for your ferry to Hong Kong. On arrival at Hong Kong you will be transferred to city hotel Check in to Hotel .at evening Explore city by your own, back to hotel over night stay at Hong kong .&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 4: Hong Kong- Half Day Sight Seeing &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After Breakfast at hotel meet our local representative and proceed for half day city tour. Today you will Visit the Man Mo Temple, Aberdeen fishing village, Victoria Peak, lastly Stanley market and Repulse Bay. After city tours you have Rest of the day is free at leisure &amp; shopping. Spend overnight at Hotel in Hong Kong.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 5: Hong Kong -&lt;/strong&gt; &lt;strong&gt;One full day Disney tour&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Have breakfast in morning and rest of the day is free at leisure or for shopping. Or you can take optional tours to Disney. Visit Hong Kong Disneyland and embark on a magical journey through various themed lands. Disney stories and characters really come to life here. Fill your day enjoying the numerous rides and shows the park has to offer. Evening come back to Hotel, over night at Hong ko ng Hotel&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 6: Hong Kong- Departure &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast at the hotel check-out of hotel and transfer to airport to board your return flight for home. With lots of Sweet memories of vacation.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Inclusion:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Return Airfare on Cathay pacific air line in Economy class&lt;/li&gt;\r\n	&lt;li&gt;03 Nights stay in Hong Kong Harbour Plaza Metropolis&lt;/li&gt;\r\n	&lt;li&gt;02 Nights stay in Macau Best Western Hotel Taipa-Macau&lt;/li&gt;\r\n	&lt;li&gt;Daily Breakfast&lt;/li&gt;\r\n	&lt;li&gt;Half Day City Tour in Hong Kong&lt;/li&gt;\r\n	&lt;li&gt;Half Day City Tour in Macau with local lunch&lt;/li&gt;\r\n	&lt;li&gt;Return ferry tickets&lt;/li&gt;\r\n	&lt;li&gt;One full day Disney tour in SIC&lt;/li&gt;\r\n	&lt;li&gt;Return Airport Transfer&lt;/li&gt;\r\n	&lt;li&gt;All Tours &amp; Transfers on Seat In Coach basis.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Exclusions: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Overseas Travel Insurance changeand Visa Cost&lt;/li&gt;\r\n	&lt;li&gt;Surcharge for transfers between 2300 - 0730 hours&lt;/li&gt;\r\n	&lt;li&gt;Surcharges applicable during Conventions, Special Events and Trade fairs&lt;/li&gt;\r\n	&lt;li&gt;Peak Season Surcharges for Christmas, New Year &amp; Chinese New Year&lt;/li&gt;\r\n	&lt;li&gt;Cost of Meals other than those specified in inclusions&lt;/li&gt;\r\n	&lt;li&gt;Cost of foreign exchange for personal expenses&lt;/li&gt;\r\n	&lt;li&gt;Early check-in and late check-out are on request basis only and subject to room availability&lt;/li&gt;\r\n	&lt;li&gt;Expenses of personal nature, mini bar in the room, Laundry, telephone bills, tips, gratuities etc&lt;/li&gt;\r\n	&lt;li&gt;Any increase in the cost that may come into force prior to the departure date including change in price owing to fluctuation in the rate of exchange.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n','1393840912-2HVmm0FuXyIl7W2nuJyl.jpg','',0,0,0,'',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,'2014-03-03 10:02:28','2014-01-27 11:25:29'),(7,'Honeymoon in Spain 7 Night/8Days',NULL,NULL,NULL,NULL,NULL,'Madrid is the capital of Spain and its largest city. The population of the city is roughly 3.3 million and the entire population of the Madrid metropolitan area is calculated to be a','&lt;p&gt;&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Honeymoon in Spain 7 Night/8Days &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;(2N Madrid /3 N Ibiza /2 N Barcelona)&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Madrid &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Madrid is the capital of Spain and its largest city. The population of the city is roughly 3.3 million and the entire population of the Madrid metropolitan area is calculated to be around 6.5 million. It is the third-largest city in the European Union, after London and Berlin, and its metropolitan area is the third-largest in the European Union after London and Paris. While Madrid possesses a modern infrastructure, it has preserved the look and feel of many of its historic neighborhoods and streets. Its landmarks include the Royal Palace of Madrid; the Royal Theatre with its restored 1850 Opera House; the Buen Retiro park, founded in 1631; the 19th-century National Library building (founded in 1712) containing some of Spain&#39;s historical archives; a large number of National museums, and the Golden Triangle of Art, located along the Paseo del Prado and comprising three art museums: Prado Museum, the Reina Sof&iacute;a Museum, a museum of modern art, and the Thyssen-Bornemisza Museum, which completes the shortcomings of the other two museums. Cibeles Palace and Fountain have become the monument symbol of the city. The nightlife in Madrid is one of the city&#39;s main attractions. Tapas bars, cocktail bars, clubs, jazz lounges, live music venues, flamenco theatres and establishments of all kinds cater to all. Every night, venues pertaining to the Live Music Venues Association La Noche en Vivo host a wide range of live music shows. Everything from acclaimed to up-and-coming artists, singer-songwriters to rock bands, jazz concerts or electronic music sessions to enjoy music at its best.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Ibiza Island.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Ibiza is an island in the Mediterranean Sea, 79 kilometres (49 miles) off the coast of the city of Valencia, in eastern Spain. It is the third largest of the Balearic Islands, an autonomous community of Spain. Its largest cities are Ibiza Town, Its highest point, called Sa Talaiassa , is 475 metres (1,558 feet) above sea level.Ibiza is considered to be a popular tourist destination, especially due to its legendary and at times riotous nightlife centred around two areas: Ibiza Town, the island&#39;s capital on the southern shore and Sant Antoni to the West. Well-known nightclubs are Privilege, Amnesia, Space, Pacha, Eden, Es Parad&iacute;s, Underground and DC10. During the summer, the top producers and DJs in dance come to the island and play at the various clubs, in between touring to other international destinations. Some of the most famous DJs run their own weekly nights around the island. Many of these DJs use Ibiza as an outlet for presenting new songs within the house, trance and techno genres of electronic dance music. The city has achieved renown worldwide fame as a cultural center for house and trance in particular, with its name often being used as a partial metonym for the particular flavor of electronic music originating there, much like Goa in India. The island&#39;s government is trying to encourage a more cultured and quieter tourism scene, passing rules including the closing of all nightclubs by 6 a.m. at the latest, and requiring all new hotels to be 5-star. The administration wants to attract a more international mixture of tourists.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Barcelona:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Barcelona is the 16th-most-visited city in the world and the fourth most visited in Europe after Paris, London, and Rome, with several million tourists every year.With its Rambles, Barcelona is ranked the most popular city to visit in Spain.Barcelona as internationally renowned a tourist destination, with numerous recreational areas, one of the best beaches in the world, mild and warm climate, historical monuments, including eight UNESCO World Heritage Sites, many good-quality hotels, and developed tourist infrastructure.&lt;/p&gt;\r\n\r\n&lt;p&gt;Barcelona is today one of the world&#39;s leading tourist, economic, trade fair/exhibitions and cultural-sports centres, and its influence in commerce, education, entertainment, media, fashion, science, and the arts all contribute to its status as one of the world&#39;s major global cities.It is a major cultural and economic centre in southwestern Europe (Iberian Peninsula), 24th in the world financial centre . As of 2009 the city was ranked Europe&#39;s third and one of the world&rsquo;s most successful as a city brand. At the same time, the city was ranked Europe&#39;s fourth best city for business and fastest improving European city, Barcelona is a transport hub with one of Europe&#39;s principal seaports, an international airport which handles above 35 million passengers per year, an extensive motorway network and a high-speed rail line with a planned link to France and the rest of Europe&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 1: Madrid Arrival &nbsp;&nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Wel come to Madrid!! Upon arrival at Air port Meet our local Representative and Proceed to Madrid City, check in to Hotel, Evening at Leisure. Over night at Hotel&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 2: Madrid &ndash;&lt;/strong&gt;&lt;strong&gt;Madrid Sightseeing Tour and Real Madrid Santiago Bernabeu Stadium&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After Breakfast proceed to Sightseeing along different parts of the city. Medieval, the renaissance, the Baroque and the neoclassic, the romantic and the modern. They speak of a torero&#39;s Madrid, flamenco&rsquo;s Madrid and an artists Madrid. This city sightseeing tour is shorter than usual (1.30 hrs) in order to give time to the exciting tour of Real Madrid&#39;s football Stadium, Santiago Bernabeu. Bernabeu opens its doors to turn you into the real megastar. You will have the chance to look through the Stadium with no limits, and even have the access to those places that you only had pictured in your mind. Our Stadium is awaiting you with all its real myths, like the tunnel to locker rooms, the bench, the pitch, the press room and the even presidential box. Also you will visit the new Trophies Exhibition, the chief exponent of Real Madrid legend, the Best Club in the 20th century. Come in and enjoy the most thrilling time you will ever live. Quietly, no hurry at all. The Bernabeu also has a restaurant with a surface area of 1200 sqm on two floors, and 80 metres of glass windows with spectacular views of the pitch. Tour finish in Stadium Santiago Bernabeu evening at Leisure&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 3: Madrid &ndash; Ibiza By flight &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After Breakfast. Check out form the hotel. Transfer to air Port. Upon arrival at Ibiza Transfer Hotel, Check in to Hotel, Spend evening Exploring the City and Beaches by your Own, over Night at Ibiza Hotel&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 4: Ibiza -Ibiza Town Scooter Tour &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After Breakfast, proceed to Guided scooter tour on Ibiza, Discover the main sights of this UNESCO World Heritage-listed city. Drive through Dalt Vila, the medieval quarter. Visit the beautiful village of Sa Canal Relax during free time at Las Salinas Beach Enjoy the fresh air and sunshine as you ride along the Mediterranean coast .Evening at Leisure, Over Night at Ibiza&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 5: Ibiza &ndash; Day at Leisure&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After Breakfast today you have full day at Leisure, Explore the Beautiful Beach Nearby your Hotel, over night at Ibiza Hotel&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 6: Ibiza &ndash; Barcelona by Flight &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After Breakfast. Check out form the hotel Proceed to Ibiza air Port. Upon arrival at Barcelona&nbsp; Check in to Hotel, Spend evening Exploring the City and Beaches by your Own, over Night at Barcelona&nbsp; Hotel&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 7: Barcelona -&lt;/strong&gt;&lt;strong&gt;Barcelona Highlights City Tour Morning&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After Breakfast Proceed to&lt;strong&gt; Barcelona Highlights City Tour Morning,&lt;/strong&gt; This tour departs from the bus terminal and continues to via Layatena, Cathedral, the Gothic Quarter and Plaza St. Jaume. We continue to the Port and the Olympic Village which we shall tour. Subsequently, we shall go to Montjuic for a panoramic view of city and port. Cable car up to Montjuich Castle. We shall tour the Olympic Stadium and Sant Jordi Palace. Visit to the Spanish Village of Barcelona, 117 typical buildings from all over Spain on show with restaurants, shops and handcraft workshops. The visit includes glass of the famous Catalan Cava. The tour returns past the famous Plaza De Espana to the bus terminal, where the tour finishes.Enjoy Evening for shopping and Leisure over night at Barcelona Hotel&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 8:&nbsp; Departure &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After Breakfast at Hotel, Check out form Hotel transfer to Air port for on word Journey&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Package Inclusion:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Return air fare and Taxes Ex Kathmandu with taxes&lt;/li&gt;\r\n	&lt;li&gt;2 night accommodationin Madrid at Hotel Best western or similar&lt;/li&gt;\r\n	&lt;li&gt;2 night accommodation in Barcelona at Hoteldel Mar, Barcelona or Similar&lt;/li&gt;\r\n	&lt;li&gt;2 Night accommodation in Valcian at hotel Tres Torres or similar&lt;/li&gt;\r\n	&lt;li&gt;Daily breakfast at Hotel&lt;/li&gt;\r\n	&lt;li&gt;Madrid Sightseeing Tour and Real Madrid Santiago&lt;/li&gt;\r\n	&lt;li&gt;Barcelona Highlights City Tour Morning&lt;/li&gt;\r\n	&lt;li&gt;Ibiza Island Scooter tours 4 Hr&lt;/li&gt;\r\n	&lt;li&gt;Return Air port/ Station Transfers at Pvt Basis at Madrid and Barcelona&lt;/li&gt;\r\n	&lt;li&gt;International Travel insurance&lt;/li&gt;\r\n	&lt;li&gt;France Tourist Visa Cost&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Exclusions: &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;ROE 1 Euro: NPR 133. Final amount will calculateas per the date of Payment&lt;/li&gt;\r\n	&lt;li&gt;Surcharge for transfers between 2300 - 0730 hours&lt;/li&gt;\r\n	&lt;li&gt;Domestic Flight in Spain&lt;/li&gt;\r\n	&lt;li&gt;Surcharges applicable during Conventions, Special Events and Trade fairs&lt;/li&gt;\r\n	&lt;li&gt;Peak Season Surcharges for Christmas,New Year &amp; Chinese New Year&lt;/li&gt;\r\n	&lt;li&gt;Cost of Meals other than those specified in inclusions&lt;/li&gt;\r\n	&lt;li&gt;Cost of foreign exchange for personal expenses&lt;/li&gt;\r\n	&lt;li&gt;Early check-in and late check-out are on request basis only and subject to room availability&lt;/li&gt;\r\n	&lt;li&gt;Expenses of personal nature, mini bar in the room, Laundry, telephone bills, tips, gratuities etc&lt;/li&gt;\r\n	&lt;li&gt;Any increase in the cost that may come into force prior to the departure date including change in price owing to fluctuation in the rate of exchange.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n','1393841733-zcArnTHLnTM805MMXDVs.jpg','',0,0,0,'',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,'2014-03-03 10:16:37','2014-01-28 02:52:37'),(33,'test',NULL,NULL,NULL,NULL,NULL,NULL,'&lt;p&gt;test&lt;/p&gt;\r\n','1411636875-jyskBk7XZ4o9yxlVylOo.jpg','1411636875-jyskBk7XZ4o9yxlVylOo_thumb.jpg',0,0,0,'',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NU