ra','Pokhara',61,3,3,0,3,4,' tourist bus','kathmandu','kathmandu','pokhara','15 November 2014','all',15,'','','','','','scenic beauty','3nights 4 days in pokhara',' The Bardiya National Park:\r\nThe Bardiya National Park is a protected area in Nepal that was established in 1988 as Royal Bardia National Park. Covering an area of 968 km2 (374 sq mi) it is the largest and most undisturbed national park in Nepal&#039;s Terai, adjoining the eastern bank of the Karnali River and bisected by the Babai River in the Bardiya District. Its northern limits are demarcated by the crest of the Siwalik Hills. The Nepalgunj-Surkhet highway partly forms the southern boundary, but seriously disrupts the protected area. Natural boundaries to human settlements are formed in the west by the Geruwa, a branch of the Karnali River, and in the southeast by the Babai River.Together with the neighboring Banke National Park, the coherent protected area of 1,437 km2 (555 sq mi) represents the Tiger Conservation Unit (TCU) Bardia-Banke that extends over 2,231 km2 (861 sq mi) of alluvial grasslands and subtropical moist deciduous forest , The wide range of vegetation types in forest and grassland provides excellent habitat for 642 faunal species. The Karnali-Babai river system, their small tributaries and myriads of oxbow lakes is habitat for 125 recorded species of fish. A small population of gharial inhabits the rivers. Apart from the mugger crocodiles, 23 reptile and amphibian species have been recorded. Current checklists include 407 bird species, among them the Bengal florican, white-rumped vulture, peafowl, and bar-headed geese, which are symbolic of the park.[5] Lesser florican and Sarus crane are present; grey-crowned prinia, jungle prinia, pale-footed bush warbler, aberrant bush warbler, striated grassbird, golden-headed cisticola and chestnut-capped babbler occur in the park&#039;s grassland\r\n\r\nDay 01:  Bardiya &ndash; Nepalganj Air Port/ Bus Stop        \r\nMeal : Dinner \r\nWel come to Nepal!!!  On arrival at Nepalgung air Port / Bus Stop Meet our Local representative and Proceed to bardia national  park , check in to resort enjoy and Relax in our Tharu bar or  beautiful garden , Discover Tharu life and culture through our Tharu village and culture tour. Visit to Tharu Museum and Visit to Crocodile Breeding Center, dinner at resort .over night at bardia resort \r\n\r\nDay 2 &ndash; Bardia Jungle actives                                                                               \r\nMeal: Breakfast /Lunch /Dinner                                                                                            \r\nAfter breakfast start your day. Prepare yourself for the adventures day ahead, whole day your be spending time Walking in to the bardiya National park. You will escort by Very Profanational team and get change to encounter with the wild life animal and secine beauty to Forest fauna, back to hotel, also going form Gangetic Dolphin- swimming possible. Over night at bardiya Hotel \r\n\r\nDay 3: Half day walking tours / Elephant back safari/ Jeep safari     \r\nMeal: Breakfast /Lunch /Dinner                                                                                                             \r\n After Breakfast Hotel, today your be transfer for Half day walking tours of Bardiya National park, later your be taken for Elephant \r\nBack safari tours, you will be Seeing Tiger, one hord Rhino etc during elephant safari  follow by the Jeep safari tours inside the national park \r\nEvening back to Hotel, Enjoy your meal, over night at Bardiya Hotel\r\n\r\n\r\n\r\n\r\nDay 04: Bardia &ndash; Bird watching -Departure Nepalganj   air port/ Bus Stop        \r\nMeal: Breakfast / Lunch\r\nAfter the Breakfast at hotel, early morning bird watching &ndash; followed by chance to relax or explore the surrounding village\r\nAlso explore and visit to famous Elephant Breeding Center at bardia national   Park later take your lunch you will transfer to nepalgang air port / Bus Stop \r\n\r\n',10,'2014-10-19 13:41:52','2014-10-31 00:00:00','','','','',1,0,0,'2014-10-19 07:57:09','2014-10-19 07:57:09'),(38,'Nepal','Explore Nepal','Black Eyes Journeys','Domestic Tours','','','Sight-seeing','&lt;p&gt;Sight seeing and diversification of Nepal and various places over here.&lt;/p&gt;\r\n','default.png','default.png',120,85,65,'Per person',' 60%should be cleared after booking and rest after the completion of tour.',151,'Kathmandu','Kathmandu',977,6,3,11,6,7,'tourist bus ','kathmandu','kathmandu','pokhara, chitwan, kathmandu','','all attractions, natural beauty',15,'hindi, english, french','yes','on request','yes','on request','city tour','explore nepal','Detail Itinerary:\r\nDay 01: Arrival Kathmandu &ndash; Nagarkot \r\nBy Road 1.5 Hr approx (35 Km)	\r\nMeal: Dinner only \r\n\r\nWelcome to Nepal, On the Arrival at Tribhuvan International Airport Meet our Local representative and board a vehicle and drive to nagarkot \r\nExploring beautiful seine Mountain on the way, check in to Hotel and relax for a while, in evening enjoy the beautiful view of sunset and \r\nExplore the local activities; Dinner will serve at hotel, over night at Hotel \r\n\r\nDay 02: Nagarkot &ndash; Pokhara \r\n(200km, 6-7 hrs drive)	                                                        \r\n Breakfast /Lunch / Dinner \r\nWake up early in the morning (5:30 am ) to see the sunrise at the Himalayan ranges including Mount Everest (The highest point in the world) if the weather is clear. After breakfast proceed for scenic drive to Pokhara (230 KMS / 7 hours drive). While driving   nagarkot to pokhara you will witness the nature beauty of Nepal, hilly mountain, forest, local culture and people, lunch will be provide en route, open arrive at pokhara check in to Hotel and day at leisure in the evening, you can also explore the Pokhara valley In the Evening to for shopping, try some luck at casino and to explore the city by your won also. Dinner will be serve in the local restaurant / or Hotel,\r\n\r\n\r\nDay 03: Pokhara- Sarangkot- half day Sightseeing and 1 hr Fewa Boating at Few lake 	\r\n Meal Lunch and Dinner \r\n\r\nAfter the Breakfast at hotel, we will transfer you to small but seine hill station Sunrise tour to Sarangkot,  From Sarankot, on the northern direction we can see Dhawalagiri in the far west . Annapurna range is visible when the weather is clear on the same side. On the southern direction the village overlooks the city of Pokhara and its lake on the north-western outskirts of the city. After sarankot tours proceed to pokhara and have lunch at lake side restaurant , after lunch proceed to 1 hr Fewa lake boat tours , visit to Mahadevs cave , davi,s Fall , mountain museum and many more&hellip; Dinner will be serving at Hotel or restaurant \r\n												\r\n\r\nDay 04: Pokhara - Chitwan National Park (heart of the jungle.) 	\r\n(155 Kms, 4/5 hrs drive)                            \r\n Meal:  Breakfast/ Lunch / Dinner\r\nAfter Breakfast, Proceed to toward the Chitwan national park 4/5 hr Senice highway drive , finally arrive Chitwan and check into Jungle camp /resort at Chitwan , lunch at Resort , free time to leisure , at evening enjoy the Tharu Cultural show in the evening perform  by  local People\r\nFollowed by Dinner &amp; overnight.\r\n \r\n\r\n\r\n	\r\n\r\n						\r\nDay 05: Chitwan National Park - Jungle Safari Activities 	                    \r\nMeal: Breakfast / Lunch /Dinner \r\nAfter breakfast it&rsquo;s time to encounter wildlife animal at national park ,the enjoy the Elephant back safari inside the jungle to see the famous one-horned rhinos of Asia, wild boars different kinds of deer&rsquo;s, if you are lucky, you might have an opportunity to see tiger and many more animals. Return back to hotel, lunch is served. After lunch, canoe ride on Buri Rapti River to see the crocodiles, after visit Elephant breeding center. Evening transfer to local market place &amp; shopping of their own, back to hotel. Late evening, Dinner will be served, overnight at hotel.\r\n\r\nDay 06: Chitwan National Park &ndash; Manakamana Temple - Kathmandu                                             \r\n Meal: Breakfast /Lunch /Dinner\r\n\r\nAfter breakfast, proceed Chitwan to Kathmandu Explore senie beauty on route ,  lunch will be service in local restaurant on the way ,Visit manakamana temple and enjoy Cable Car ride then drive to  upon arrive at Kathmandu check in to hotel ,  evening Nepali traditional cultural dance program followed by dinner at the typical Nepali restaurant.\r\n\r\nDay 07: Kathmandu &ndash; full day Sightseeing tours ( 8 Hr )	                                                             \r\n Meal: Breakfast / Lunch / Dinner \r\n\r\nAfter breakfast at the hotel proceed for sightseeing to(UNESCO World Heritage Site Pashupatinath temple , Boudhanath Stupa , and Swyambhunath Stupa . Lunch enroute sightseeing. After lunch proceed for sightseeing tour to Kathmandu Durbar Square &ndash; Kumari Temple.\r\nAfter Sightseeing will drop you at Famous Shopping Street of capital at thamel, where you can buy Nepali handmade and traditional handicraft souvenir after shopping back to hotel,   Dinner and overnight stay at the hotel in Kathmandu. \r\n\r\nDAY 08: Kathmandu (Departure)                                             	                                              \r\n Breakfast Only\r\nOptional tours: Everest Mountain flight	\r\nBreakfast at the Hotel and free at your own leisure till the departure or take option tours Everest Mountain flight an hour-long flight usually in the morning to see the Himalayan peaks, several of them above eight thousand meters, including Mount Everest, the world&rsquo;s tallest at 8,848 m. It is something not to be missed time come back to Hotel then check out form the hotel and drive to International Airport for your onward flight to home with memory of Nepal.\r\n ',5,'2014-11-01 00:00:00','2014-11-29 00:00:00','','&lt;p&gt;sight seeings, wildlife&lt;/p&gt;\r\n','&lt;p&gt;customization of the tour may lead to price change and itinerary change&lt;br /&gt;\r\n&nbsp;&lt;/p&gt;\r\n','&lt;p&gt;payment should be made as per policy of the company.&lt;/p&gt;\r\n',1,8,5,'2014-10-19 10:28:42','2014-10-19 10:28:42'),(39,'Nepal','Classic Nepal Tour','Black Eyes Journeys','Domestic Tours','','','Natural Beauty &amp; History','&lt;p&gt;History of Kathmandu Valley along with the natural and scenic beauty of Nagarkot.&lt;/p&gt;\r\n','default.png','default.png',80,65,65,'Per person',' All the payment should be cleared after the confirmation of the booking.',151,'Kathmandu','Kathmandu',977,3,2,12,3,4,'Tourist Bus ','Kathmandu','Kathmandu','Kathmandu, Nagarkot (Hill Station))','12 month','museums. city tour',25,'hindi and english','yes','no','yes','no','city tour','Classic Nepal Tour','Day 01: Arrival Kathmandu &ndash; Nagarkot (By Road 1.5 Hr approx (35 Km)	                                   \r\nMeal: Dinner only \r\nWelcome to Nepal, On the Arrival at Tribhuvan International Airport Meet our Local representative and board a vehicle and drive to nagarkot \r\nExploring beautiful seine Mountain on the way, check in to Hotel and relax for a while, in evening enjoy the beautiful view of sunset and \r\nExplore the local activities; Dinner will serve at hotel, over night at Hotel \r\n\r\nDay 02: Nagarkot &ndash; Bhaktapur Durbar Square - Kathmandu                                                 \r\n Meal: Breakfast /Lunch /Dinner \r\nWake up early in the morning (5:30 am ) to see the sunrise at the Himalayan ranges including Mount Everest (The highest point in the world) if the weather is clear. After breakfast proceeds visit local village&amp; market, lunch will provide local restaurant then scenic drive to Kathmandu   in Route visit, BHAKTAPUR DURBAR SQUARE (UNESCO World Heritage Site), upon arrive at Kathmandu check in to hotel, evening Nepali traditional cultural dance program followed by dinner at the typical Nepali restaurant.\r\nDay 03: Kathmandu &ndash; full day Sightseeing tours (8 Hr)	                                                               \r\nMeal: Breakfast / Lunch/ Dinner \r\nAfter breakfast at the hotel proceed for sightseeing to UNESCO World Heritage Site Pashupatinath temple, Boudhanath Stupa, and Swyambhunath Stupa. Lunch while doing sightseeing. After lunch proceed for sightseeing tour to Kathmandu Durbar Square &ndash; Kumari Temple. After Sightseeing will drop you at Famous Shopping Street of capital at thamel, where you can buy Nepali handmade and traditional handicraft souvenir after shopping back to hotel,   Dinner and overnight stay at the hotel in Kathmandu\r\n\r\nDay 04: Kathmandu                                                          	                                                         \r\nMeal: Breakfast / Lunch and Dinner \r\nOptional tours: Everest Mountain flight	\r\nBreakfast at the Hotel and free at your own leisure or take option tours Everest Mountain flight an hour-long flight usually in the morning to see the Himalayan peaks, several of them above eight thousand meters, including Mount Everest, the world&rsquo;s tallest at 8,848 m. It is something not to be missed time come back to Hotel Explore   whole day by your won, lunch and Dinner will be serving at Hotel / restaurant  \r\n\r\nDay5: Kathmandu \r\nAfter breakfast Hotel then check out form the hotel and drive to International Airport for your onward flight to home with memory of Nepal.\r\n ',15,'2015-01-01 00:00:00','2015-12-31 00:00:00','','&lt;p&gt;Sight seeing, museums, city tour, temples etc&lt;/p&gt;\r\n','&lt;p&gt;Packages and Itinerary could not be customised.&lt;br /&gt;\r\n&nbsp;&lt;/p&gt;\r\n','&lt;p&gt;All payments should be made at a time of confirming booking.&lt;/p&gt;\r\n',1,7,5,'2014-10-19 10:39:13','2014-10-19 10:39:13'),(40,'Be Spiritual in Nepal','Spiritual Nepal','Black Eyes Journeys','Domestic Tours','','','Spiritual tour, Yogas, Meditations','&lt;p&gt;Feel the spiritua