kot,  From Sarankot, on the northern direction we can see Dhawalagiri in the far west . Annapurna range is visible when the weather is clear on the same side. On the southern direction the village overlooks the city of Pokhara and its lake on the north-western outskirts of the city. After sarankot tours proceed to pokhara and have lunch at lake side restaurant , after lunch proceed to 1 hr Fewa lake boat tours , visit to Mahadevs cave , davi,s Fall , mountain museum and many more&hellip; Dinner will be serving at Hotel or restaurant \r\n												\r\n\r\nDay 4: Pokhara &ndash; Lumbini (200 Km /6hr)\r\nMeal: Breakfast / Dinner \r\nAfter breakfast at Hotel Proceed to Pokhara to Lumbini Drive (200 Km / 6hr) Lunch in route at restaurant by own. Check in to Hotel at Leisure, Dinner at Hotel, and Overnight in hotel  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nDay 5: Half day Lumbini Sightseeing - Chitwan National Park (heart of the jungle.)\r\nMeal: Breakfast / Dinner \r\nAfter breakfast, your day Begin for half day Sightseeing in Lumbini including famous mayadevi Temple, Ashoka pillar etc and some famous international monasteries around, back to hotel and Proceed to toward the Chitwan national park 4/5 hr Senice highway drive , finally arrive Chitwan and check into Jungle camp /resort at Chitwan , lunch in route by own  . Check in to Camp, at evening enjoy the Tharu Cultural show in the evening perform by local People\r\nFollowed by Dinner &amp; overnight.\r\n						\r\nDay 06: Chitwan National Park - Jungle Safari Activities 	                   \r\nMeal:  Breakfast /Lunch/ Dinner \r\nAfter breakfast it&rsquo;s time to encounter wildlife animal at national park ,the enjoy the Elephant back safari inside the jungle to see the famous one-horned rhinos of Asia, wild boars different kinds of deer&rsquo;s, if you are lucky, you might have an opportunity to see tiger and many more animals. Return back to hotel, lunch is served. After lunch, canoe ride on Buri Rapti River to see the crocodiles, after visit Elephant breeding center. Evening transfer to local market place &amp; shopping of their own, back to hotel. Late evening, Dinner will be served, overnight at hotel.\r\n\r\nDay 07: Chitwan National Park - Kathmandu   (6 Hr Drive By road)\r\n Meal: Breakfast / Dinner \r\nAfter breakfast, proceed Chitwan to Kathmandu Explore senie beauty on route ,  lunch will be service in local restaurant on the way , upon arrive at Kathmandu check in to hotel ,  evening Nepali traditional cultural dance program followed by dinner at the typical Nepali restaurant.\r\n\r\nDay 08: Kathmandu &ndash; full day Sightseeing tours (8 Hr)	                                                            \r\nMeal: Breakfast /Dinner \r\nAfter breakfast at the hotel proceed for sightseeing to (UNESCO World Heritage Site Pashupatinath temple, Boudhanath Stupa, and Swyambhunath Stupa . Lunch by Own en-route sightseeing. After lunch proceed for sightseeing tour to Kathmandu Durbar Square &ndash; Kumari Temple.\r\nAfter Sightseeing will drop you at Famous Shopping Street of capital at thamel, where you can buy Nepali handmade and traditional handicraft souvenir after shopping back to hotel,   Dinner and overnight stay at the hotel in Kathmandu. \r\n\r\nDay 09: Kathmandu (Departure)                                             	                                  \r\n Meal: Breakfast Only\r\nOptional tours: Everest Mountain flight	\r\nBreakfast at the Hotel and free at your own leisure till the departure or take option tours Everest Mountain flight an hour-long flight usually in the morning to see the Himalayan peaks, several of them above eight thousand meters, including Mount Everest, the world&rsquo;s tallest at 8,848 m. It is something not to be missed time come back to Hotel then check out form the hotel and drive to International Airport for your onward flight to home with memory of Nepal.\r\n ',25,'2015-06-01 00:00:00','2015-11-01 00:00:00','','&lt;p&gt;Lumbini- birth place of Buddha, Chitwan-land of wildlifes, pokhara- valley of mountains.&lt;/p&gt;\r\n','&lt;p&gt;This tour package will be in operation during whole spring season. All the costs and Itinerary and activities mentioned in the Itinerary cant be customised .&lt;br /&gt;\r\n&nbsp;&lt;/p&gt;\r\n','&lt;p&gt;All the payments should be made as per the policy of company. 60% of the payment should be made during the timr of confirming the booking and rest should be clear within the completion of the tour.&lt;/p&gt;\r\n',1,10,12,'2014-10-19 11:16:00','2014-10-19 11:16:00'),(41,'Nepal','Visit','Nepal travels years','Domestic Tours','','','Visit Nepal 2014','&lt;p&gt;Visit&nbsp; Nepal 2014&lt;/p&gt;\r\n','1414401223-GUdRYV8WTv7PI0kyutFa.png','1414401223-GUdRYV8WTv7PI0kyutFa_thumb.png',500,500,0,'Per package','  Including tax',151,'Kathmandu','Kathmandu',977,5,4,0,1,5,'  ','kathmandu','pokhara','pokhara','','',0,'','','','','','','','  ',2,'2014-10-27 00:00:00','2014-10-29 00:00:00','','','','',16,0,0,'2014-10-27 09:13:43','2014-10-27 09:13:43'),(42,'Tour To Combodia','Tour To Combodia','BlackEyesJourney','Domestic Tours','','','6Nights 7 Days Tour to Combodia','&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;strong&gt;2 Nights&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt; PHNOM PENH&lt;/span&gt;&lt;/span&gt;/ 1Night &lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;KOMPONG CHAM&lt;/span&gt;&lt;/span&gt;/3Night &lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;SIEM REAP&nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/h2&gt;\r\n','1414475792-rPVD5Oi3qYrFYLZk3Btu.jpg','1414475792-rPVD5Oi3qYrFYLZk3Btu_thumb.jpg',699,500,0,'per_package','  60% of the payment should be made at a time of booking confirmation and rest should be cleared within the tour completion.',37,'Phnom Penh','Phnom Penh',855,6,3,18,6,7,'  International Flight , Tourist Coaches.','PHNOM PENH','SIEM REAP','PHNOM PENH,SIEM REAP, COMPONG CHAM','','All the major attractions, Stupas and City Tours, Museums Ect..',25,'English, Chinese, Japanese and French','Airport Pick Up','On Request','Airport Drop off','On Request','City Tour','Tour To Combodia','   DAY 1:  PHNOM PENH ARRIVAL 	\r\nUpon arrival at Phnom Penh International Airport, met and picked up by our representative. Transfer to hotel for check-in. In the afternoon, take the city tour covering the Independent Monument, and the National Museum. Visit the Royal Palace and the Silver Pagoda, The named Silver Pagoda, because of its floor, which is made up of 5000 silver tiles. After that, we continue to visit Wat Phnom till sunset time. Stay overnight in Phnom Penh.\r\n\r\nDAY 2: PHNOM PENH    	\r\nAfter breakfast, visit the notorious Tuol Sleng Museum (S-21 prison). This former school was used as a prison during Khmer Rouge regime. Proceed to Killing field of Cheung Ek, the field&rsquo;s more then 20000 Khmer people was killed. \r\nIn the afternoon, take time leisure at the Russian Market (Psah Tuol Thom Pong) &amp; the Central Market and Enjoy a joint Sunset Cruise on the Tonle Sap and Mekong rivers in front of Royal Palace. Stay overnight in Phnom Penh.\r\n\r\nDAY 3: PHNOM PENH - KOMPONG CHAM BY BUS\r\nHave breakfast at hotel. Depart to Kompong Cham by National Road NO. 6, on the way take break at Spider market. Continue to Kompong Cham to view examples of colonial architecture.\r\nIn the afternoon visit Wat Nokhor Bachey with its ancient temple, then continue to visit Han Chey Mountain for watching view of Tonle Mekong from the hill and surrounding landscape till sunset.  Stay overnight in Kompong Cham.\r\n\r\nDAY 4: KAMPONG CHAM &ndash; KAMPONG THOM &ndash; SIEM REAP BY BUS\r\nAfter breakfast, visit Phnom Pros &amp; Phnom Srei, the former and well known of Kampong Cham province. Then continue to Kompong Thom. En route, visit Wat Kohear Norkor (11th century). Continue to Phum Prasat with its single ancient temple. Upon arrival at Kampong Thom, visit Sambo Prei Kuk temple, the Khmer Chenla city in last pre-Angkorian period. Arrive at Siem Reap in late evening, transfer to check in at hotel and Stay overnight in Siem Reap.\r\n\r\nDAY 5: SIEM REAP   \r\nAfter breakfast, visit Rolous group, the first city of Angkorian including: Preah Koh temple, Bakong Temple and Lo Lei temple. In the afternoon, visit the most famous temples of Angkor: Angkor Wat. The world wonders build in 12th century. Angkor Wat&rsquo;s five towers symbolize Meru&rsquo;s five peaks - the enclosing wall represents the mountains at the edge of the world and the surrounding moat, the ocean beyond. Visit this temple till sunset in front of Angkor Wat temple. Transfer back to hotel. Take free time for night city tour at night market for any souvenir or pub street etc. Stay overnight in Siem Reap.\r\n	\r\nDAY 6: SIEM REAP   \r\nThis morning, get up in the early morning for sunrise at Angkor wat temple. Then transfer back to hotel for breakfast. Visit Banteay Srei temple (10th century), the pink sandstone temple regarded as the jewel in the crown of Classical Khmer Art. Then continue your visit to Banteay Samre. In the afternoon that is the great time to visit the antique capital of Angkor Thom (12th century): the South Gate with its huge statues depicting the churning of the ocean of milk, the Bayon Temple, unique for its 54 towers decorated with over 200 smiling faces of Avolokitesvara, the Phimeanakas, the Royal Enclosure, the Elephants Terrace, and the Terrace of the Leper King. Enjoy the sunset at Bakheng Mountain with 65 m high with the view from the hill top. Stay overnight in Siem Reap.\r\n\r\nDAY 7: SIEM REAP &ndash; DEPARTURE\r\nHave breakfast at hotel. Then visit Ta Prohm temple, one of the most beautiful temples in the area. Continue your temples tour at Neak Pean, a fountain built in the middle of a pool. Proceed to Preah Khan temple, built by the King Jayavarman VII. In the afternoon, visit the floating village of Chong Khneas by boat trip with traditional wooden boat on the Tonle Sap Lake, the &quot;Great Lake&quot; of Cambodia, one of the wonders of South East Asia. Then back to visit to &ldquo;Le Artisans d&rsquo;Angkor - Chantiers Ecoles&rdquo; the art &amp; caving school. Stay at own leisure till transfer to Siem Reap International Airport for departure.\r\n',10,'2014-10-28 10:49:22','2014-12-31 00:00:00','','&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;PHNOM PENH &lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Independent Monument&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;the National Museum&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Royal Palace&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;