pan&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Central Marke&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;t&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Sunset Cruise&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;KOMPONG CHAM &lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Wat Nokhor Bachey&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Han Chey Mountain&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;KAMPONG THOM &lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Phnom Pros &amp; Phnom Srei&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Wat Kohear Norkor&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Sambo Prei Kuk temple&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;,&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Phum Prasat&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;SIEM REAP &lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Angkor Wat&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;: P&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;reah Koh temple, Bakong Temple and Lo Lei temple&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Banteay Srei &lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;temple&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Banteay Samre&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Angkor Thom&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;Avolokitesvara, the Phimeanakas, the Royal Enclosure, the Elephants Terrace, and the Terrace of the Leper King&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;span style=&quot;font-family:lucida sans unicode,lucida grande,sans-serif&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background-color:#0000FF&quot;&gt;the floating village of Chong Khneas&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;h2 style=&quot;font-style:italic&quot;&gt;&lt;span style=&quot;color:#FF0000&quot;&g