Trade fairs&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:.5in&quot;&gt;&lt;img alt=&quot;*&quot; src=&quot;file:///C:/Users/user/AppData/Local/Temp/msohtmlclip1/01/clip_image001.gif&quot; style=&quot;height:13px; width:13px&quot; /&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Peak Season Surcharges for Christmas,New Year &amp; Chinese New Year&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:.5in&quot;&gt;&lt;img alt=&quot;*&quot; src=&quot;file:///C:/Users/user/AppData/Local/Temp/msohtmlclip1/01/clip_image001.gif&quot; style=&quot;height:13px; width:13px&quot; /&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cost of Meals other than those specified in inclusions&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:.5in&quot;&gt;&lt;img alt=&quot;*&quot; src=&quot;file:///C:/Users/user/AppData/Local/Temp/msohtmlclip1/01/clip_image001.gif&quot; style=&quot;height:13px; width:13px&quot; /&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cost of foreign exchange for personal expenses&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:.5in&quot;&gt;&lt;img alt=&quot;*&quot; src=&quot;file:///C:/Users/user/AppData/Local/Temp/msohtmlclip1/01/clip_image001.gif&quot; style=&quot;height:13px; width:13px&quot; /&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Early check-in and late check-out are on request basis only and subject to room availability&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:.5in&quot;&gt;&lt;img alt=&quot;*&quot; src=&quot;file:///C:/Users/user/AppData/Local/Temp/msohtmlclip1/01/clip_image001.gif&quot; style=&quot;height:13px; width:13px&quot; /&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Expenses of personal nature, mini bar in the room, Laundry, telephone bills, tips, gratuities etc&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:.5in&quot;&gt;&lt;img alt=&quot;*&quot; src=&quot;file:///C:/Users/user/AppData/Local/Temp/msohtmlclip1/01/clip_image001.gif&quot; style=&quot;height:13px; width:13px&quot; /&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Any increase in the cost that may come into force prior to the departure date including change in price owing to fluctuation in the rate of exchange.&lt;/p&gt;\r\n',1,8,5,'2014-10-28 05:56:32','2014-10-28 05:15:28'),(43,'Vietnam Tour','Tour de Vietnam','Black Eyes journey','Domestic Tours','','','Ho Chi Minh  &ndash; My Tho &ndash; Hanoi  &ndash; Ha Long  &ndash; Cu Chi &ndash; Hanoi','&lt;h3&gt;National parks of Vietnam&lt;/h3&gt;\r\n\r\n&lt;h3&gt;World Heritage Sites&lt;/h3&gt;\r\n\r\n&lt;h3&gt;Man and the Biosphere Programme&lt;/h3&gt;\r\n\r\n&lt;h3&gt;National tourist area&lt;/h3&gt;\r\n\r\n&lt;h3&gt;Cities&lt;/h3&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://en.wikipedia.org/wiki/Hanoi&quot; title=&quot;Hanoi&quot;&gt;Hanoi&lt;/a&gt; &lt;a href=&quot;http://en.wikipedia.org/wiki/Ho_Chi_Minh_City&quot; title=&quot;Ho Chi Minh City&quot;&gt;Ho Chi Minh City&lt;/a&gt; &lt;a class=&quot;mw-redirect&quot; href=&quot;http://en.wikipedia.org/wiki/Hai_Phong&quot; title=&quot;Hai Phong&quot;&gt;Hai Phong&lt;/a&gt; &lt;a href=&quot;http://en.wikipedia.org/wiki/Da_Nang&quot; title=&quot;Da Nang&quot;&gt;Da Nang&lt;/a&gt;&lt;/p&gt;\r\n','1414475545-nM1Uu4uLWWV1MmXMVdvk.jpg','1414475545-nM1Uu4uLWWV1MmXMVdvk_thumb.jpg',599,500,0,'per_package','    60% of the payment should be made at a time of booking confirmation and rest should be made within the tour completion.',233,'Thanh pho Ho Chi Minh','Thanh pho Ho Chi Minh',10,5,3,16,5,6,'   International  Flight, Tourist Coaches','Ho Chi Minh','Hanoi','Ho Chi Minh,My Tho, Cu Chi, Halong,Hanoi','','All the major attractions, Monument, Local Livelihood, Museums,City Tour',25,'English, Chinese, Japanese and French','Airport Pick up','On Request','Airport Drop off','On Request','City Area','Vietnam Tour','   Day 1: Arrival Ho Chi Minh \r\nIndian Lunch/Indian Dinner                                                                                                     \r\nUpon arrival at Tan Son Nhat airport, met by our tour guide. Have lunch at local restaurant and transfer to hotel for check-in. In the afternoon, visit War Museum &ndash; the only museum in Vietnam recognized by UNESCO as one of the 60 for-peace museums;  Notre Dame Cathedral, The Old Post Office and The People&rsquo;s Committee Hall - which are famous for French Architecture. Dinner and overnight in Ho Chi Minh (also called Saigon).\r\n\r\nDay 2: Ho Chi Minh &ndash; My Tho	\r\nHotel Bfast/Indian Lunch/Vietnamese Dinner\r\nAfter breakfast, drive to My Tho. Upon arrival, take the boat trip along Mekong River with islet stop \r\nat Thoi Son, transfer by carriage to the local people&rsquo;s house to taste seasonal fruits, enjoy traditional folk songs. Then, visit the authentic life of the local and challenge your bargaining power at cottage handicraft shops. Lunch to be served with the Mekong Delta specialties. Return to Ho Chi Minh City in the afternoon. Then, visit China Town, Thien Hau Temple, shopping at Ben Thanh Market- one of the most popular and oldest shopping attractions in Ho Chi Minh. Dinner will be served on Saigon River Cruise with entertainment show along Saigon River. Overnight in Ho Chi Minh.\r\n\r\nDay 3: Ho Chi Minh &ndash; Cu Chi &ndash; Hanoi\r\nHotel Bfast/Indian Lunch/Indian Dinner\r\nAfter breakfast, transfer to Cu Chi Underground Tunnel - where human knowledge has been enriched by experiencing a web-like tunnel system of more than 200 km in length which used to be the shelters of guerrillas during the war against American troops. Back to Ho Chi Minh for lunch. Then transfer to airport to departure for Hanoi. Upon arrival Hanoi, our tour guide and driver will meet and pick you up. Transfer to hotel for checking in. Overnight in Hanoi.\r\n\r\nVN250 SGN HAN 1500 1700 \r\n\r\nDay 4:  Hanoi &ndash; Ha Long 	\r\nHotel Bfast/Buffet Lunch/Vietnamese Dinner\r\nAfter breakfast, take Hanoi city tour covering Temple of Literature (The 1st University of Vietnam), Ba Dinh Square, Ho Chi Minh Mausoleum (close on Monday &amp; Friday) &amp; Residential Palace, One Pillar Pagoda. Proceed to visit Tran Quoc Pagoda &ndash; the Buddism Center of Hanoi. Lunch at International Buffet Sen Restaurant. Then, transfer to Ha Long Town, Ha Long Bay was awarded by UNESCO as a world natural heritage in 1994. Take four hour drive to Ha Long will show you the diversity of the North Vietnam villages and rice fields along the journey. Dinner and overnight in Ha Long. \r\n\r\nDay 5: Ha Long &ndash; Hanoi 	\r\nHotel Bfast/Seafood Lunch/Indian Dinner\r\nAfter breakfast, take 4-hour boat trip in Ha Long Bay to view multi-shaped rocks and visit the dramatic caves, grottoes such as Paradise Grotto (Thien Cung) and Wooden Stakes Cave (Dau Go). Lunch will be served on boat with the fresh seafood.  In the afternoon, back to Hanoi. Upon arrival Hanoi, visit Hoan Kiem Lake-Ngoc Son Temple, shopping at Hanoi Old Quarter. Dinner, then enjoy Water Puppet Show &ndash; the most famous Vietnamese cultural show with folk songs. Overnight in Hanoi.\r\n\r\nDay 6: Hanoi Departure	\r\nHotel Bfast\r\nAfter breakfast transfer to the airport for flight back home with sweet memories.\r\n ',5,'2014-10-28 11:30:59','2014-11-30 00:00:00','','','&lt;p&gt;This Tour Package can&#39;t be customised as per request of the visitor.&lt;/p&gt;\r\n\r\n&lt;p&gt;The price of the package is only valid till the last date of this offer.&lt;/p&gt;\r\n\r\n&lt;p&gt;No other activities and services not mentioned in Itinerary will be included in the price of this package.&lt;/p&gt;\r\n\r\n&lt;p&gt;No legal formalities and process is done but can assist as per request of visitor.&lt;/p&gt;\r\n\r\n&lt;p&gt;No other itinerary will be designed for the same price and same duration and for same destination.&lt;/p&gt;\r\n','&lt;p&gt;&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;Package Includes:&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;2 Night accommodation in Ho Chi Minh at Hotel Le Duy OR Similar.&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;2 Night accommodation inHanoi at Royal Gate or Similar&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;1 Night accommodation in Haling at Blue Sky.&lt;/p&gt;\r\n\r\n&lt;p&gt;Package Excludes&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;Overseas travel insurance charges.&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;All other personal expenses.&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n',1,10,8,'2014-10-28 06:09:58','2014-10-28 05:52:25'),(44,'Tour to MuktiNath','Tour to MuktiNath','Black Eye Journeys','Domestic Tours','','','Enjoy the diverse landscape and nature and Himalayas from Muktinath..','&lt;p&gt;&lt;span style=&quot;line-height:1.6&quot;&gt;Muktinath is a sacred place both for Hindus and Buddhists located in Muktinath Valley at an altitude of 3,710 meters at the foot of the Thorong La mountain pass (part of the Himalayas), Mustang district, Nepal. The site is close to the village of Ranipauwa, which sometimes mistakenly is called Muktinath as well The Hindus call the sacred place Mukti Kshetra, which literally means the &quot;place of liberation or moksha&quot;. Mainly the temple is with a predominant Sri Vaishnava origin and worshipped by Buddhists. This temple is considered to be the 105th among the available 108 Divya Desam. The ancient name of this place, before Buddhist origin is known as Thiru Saligramam. This houses the Saligrama sila considered to be the naturally available form of Sriman Narayana [1]- the Hindu God HEAD. It is also one of the 51 Sakthi peetams.[2] The Buddhists call it Chumig Gyatsa, which in Tibetan means &#39;Hundred Waters&#39;. For Tibetan Buddhists, Muktinath-Chumig Gyatsa is a very important place of Dakinis, goddesses known as Sky Dancers and one of the 24 Tantric places. They understand the murti to be a manifestation of Avalokitesvara.&nbsp;&lt;/span&gt;&lt;/p&gt;\r\n','default.png','default.png',200,150,0,'Per package',' 60% of payment should be made after the confirmation of the booking and remaining within the tour completion date/',102,'Kathmandu','Kathmandu',977,5,3,201,5,6,'  Tourist Vehicle','Kathmandu','Kathmandu','Kathmandu, Pokhara, jomsom, Muktinath','','all the major attractions, himalayas views etc',15,'english, japanese, chinese, french','available','on request','available','on request','Mountain View','Tour to Muktinath','&lt;p&gt;&lt;strong&gt;Day 01: Arrival Kathmandu &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Meal: &nbsp;Dinner&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Welcome to Nepal, On the Arrival at Tribhuvan International Airport Meet our Local representative and board a vehicle and drive to Kathmandu Hotel &nbsp;&nbsp;check in to Hotel and relax for a while, Nepali traditional cultural dance program followed by dinner at the typical Nepali restaurant.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 02: Kathmandu &ndash; Pokhara by road (6hr) &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&nbsp;Meal: Breakfast /Dinner &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast proceed to Pokhara by road, enjoy beautiful seines beauty en route, take lunch on the way, visit Famous manakamana temple and enjoy cable car ride later proceed to &nbsp;Pokhara check in to hotel , Evening free explore lake site by your own , Dinner at lake side restaurant ,back to hotel , over night in Pokhara,&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 3 &ndash; Pokhara &ndash; Jomsom &ndash; Mukhtinath Temple &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&nbsp;Meal: Breakfast /lunch /Dinner&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Wake up early Moring, proceed to Pokhara airport fly to Jomsom, upon arrive at Jomsom Meet our&nbsp; repetitive and check in to hotel , later Proceed to Famous Mukhtinath temple (22 Km /1.5 Hr ) after dersan at temple back to Jomsom , enjoy Lunch Hotel , evening free to explore&lt;/p&gt;\r\n\r\n&lt;p&gt;Jomsom by your Own, Dinner at hotel, overnight stay in Jomsom.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 04: Jomsom - Pokhara- half day Sightseeing and 1 hr Fewa Boating at Few lake &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&nbsp;Meal: Breakfast / Dinner &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After the Breakfast at hotel, board a flight from Jomsom to Pokhara, upon arrival transfer to Pokhara hotel. After lunch Proceed to half day sightseeing&nbsp;&nbsp; tours of, follow by 1 hr Fewa lake boat tours, visit to Mahadevs cave, davi, s fall, mountain museum and many more&hellip; Dinner will be serving at Hotel or restaurant&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&lt;strong&gt;Day 05: Pokhara - Kathmandu&nbsp;&nbsp; (by Air)/ half day sightseeing valley tour &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&nbsp;Meal: breakfast / Dinner&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;After breakfast, precede Pokhara to Kathmandu by air plane; pick up form air port transfer to hotel, Proceed to half day sightseeing tour of Kathmandu, Pashupatinath temple and Boudhanath Stupa , back to Hotel in the evening ,Dinner at Hotel / restaurant , over night at Kathmandu&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Day 06: Kathmandu (Departure) &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n',5,'2014-11-02 12:06:47','2014-12-31 00:00:00','','','','',1,0,0,'2014-11-02 06:27:20','2014-11-02 06:27:20');
