of a team of young but experienced professionals of the highest qualifications in the Nepal Tourism Industry. Travel inspires us, drives us to explore ourselves as well as our lives. All of us dream of a holiday but many a times are not able to live the dream. Our goal is to offer affordable travel for everyone, anytime, anywhere, around the world. It could be the leisure, family, honeymoon, historical, educational, business, and adventure or pilgrims destinations. We offer the best program, well planned and conducted by professional, experienced, enthusiastic and affectionate travel managers. If you love to explore places on your own, then we are the experts to tailor make holidays as per your liking and test. If you are a corporate, we offer all possible business travel solutions for you and your team, however big or small it may be.&lt;br /&gt;\r\nWe take great pride in showcasing the many facets of Naturally Nepal to people all around the world with Inbound Holidays. To give you a complete holiday experience, we also take care of your international and domestic tickets, Hotel accommodation, trekking and adventure actives in Nepal, Bhutan and Tibet , transfer and sightseeing, visas, experience multi language guide, forex and insurance. All this with personalized and customized service yet professional and transparent. Since our establishment, we have shared the enjoyment, thrill, adventure &amp; excitement with numerous individuals and our experience and hunger for innovativeness have made us only better and better over the years. Flawless and innovative planning, right up to the smallest detail, has always been a way of life.&lt;br /&gt;\r\nWe are thankful to you for the love and believe that you have always showered on us and which inspired us to work hard and honestly to full fill your dream of holidays. So come to black eye journey and discover the world with us. We assure you Best of world class holidays with sweet memories and unlimited experiences to you and your family&lt;/p&gt;\r\n\r\n&lt;p&gt;Thanks and Best regards&lt;br /&gt;\r\nMahendra Panthi&lt;br /&gt;\r\nManaging Director&lt;br /&gt;\r\nBlack eye journeys (P) Ltd&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Ayurveda&lt;/strong&gt;&lt;a href=&quot;\\&quot;&gt;&lt;strong&gt;&lt;img alt=&quot;\\&quot;birds-watching-in-nepal\\&quot;&quot; src=&quot;\\&quot; style=&quot;\\&quot;height:350px&quot; /&gt;&lt;/strong&gt;&lt;/a&gt;&lt;br /&gt;\r\nNepal&rsquo;s varied elevations support more than 850 species of birds, or about 10 percent of the world&rsquo;s total species. Migratory birds are seen in winters. The spiny babbler is unique to Nepal as it has yet to be spotted outside this country. More than 450 species of birds have been spotted in Chitwan National Park, while the Koshi Tappu Wetlands have been designated Asia&rsquo;s finest bird watching site. The Mai Valley and Tamur Valley in east Nepal, Lumbini in central Nepal, and Dang Valley and Ghodagodhi Lake in the west are also good locations to sight exotic birds. As bird watching becomes immensely popular, specialized bird-watching tours are offered in the different national parks and wildlife reserves.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Boating / Fishing / Angling&lt;a href=&quot;\\&quot;&gt;&lt;img alt=&quot;\\&quot;bungy-in-nepal\\&quot;&quot; src=&quot;\\&quot; style=&quot;\\&quot;height:350px&quot; /&gt;&lt;/a&gt;&lt;/strong&gt;&lt;br /&gt;\r\nThe ultimate thrill of a bungee jump can now be experienced in Nepal &ndash; 12 km from the Nepal-Tibet border, a three-hour bus ride from Kathmandu. The bungee jump was designed by one of New Zealand&rsquo;s leading bungee consultants, and is operated by some of the most experienced jump masters in the business. The jump takes place from a 166 m wide steel suspension bridge that joins two sides of a deep valley over the raging Bhoti Kosi River. The place has spectacular scenery with dense forests covering the top of the cliff. One can overnight here and go rafting and rock climbing, too.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Butterfly Watching&lt;a href=&quot;\\&quot;&gt;&lt;img alt=&quot;\\&quot;cable-car-in-nepal\\&quot;&quot; src=&quot;\\&quot; style=&quot;\\&quot;height:350px&quot; /&gt;&lt;/a&gt;&lt;/strong&gt;&lt;br /&gt;\r\nThe only cable car in Nepal takes you on a pilgrimage tour, up to the abode of the wish-fulfilling Goddess &nbsp;Manakamana, from Kurintar in Mugling.&lt;/p&gt;\r\n\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Canyoning&lt;a href=&quot;\\&quot;&gt;&lt;img alt=&quot;\\&quot;everest-skydive\\&quot;&quot; src=&quot;\\&quot; style=&quot;\\&quot;height:350px&quot; /&gt;&lt;/a&gt;&lt;/strong&gt;&lt;br /&gt;\r\nEmerging as an extreme form of aerial adventure, Everest Skydiving is one of the adventure world&rsquo;s unique experiences. Skydiving is done from a plane or a chopper onto the world&rsquo;s highest drop zone at Gorak Shep, Kala Patthar. The skydiving takes place in front of Mount Everest (8,848 m), and the free fall takes place past some of the world&rsquo;s highest mountain peaks. It is a unique way of experiencing the Himalayas from both above and below. Experienced pilots with skydiving ratings man the aircraft, so safety is guaranteed. Skydiving can be either a solo jump or in tandem.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Golf&lt;a href=&quot;\\&quot;&gt;&lt;img alt=&quot;\\&quot;hunting-in-nepal\\&quot;&quot; src=&quot;\\&quot; style=&quot;\\&quot;height:350px&quot; /&gt;&lt;/a&gt;&lt;/strong&gt;&lt;br /&gt;\r\nLicensed hunting is allowed in the Dhorpatan Hunting Reserve in the western part of Nepal. Dhorpatan is the prime habitat of the blue sheep, ghoral, serow, Himalayan tahr, black bear, pheasant and partridge. Endangered species here include the cheer pheasant and red panda. Hunting is allowed only after acquiring a license from the Department of National Parks and Wildlife Conservation (DNPWC) in Kathmandu and is restricted to certain times in a year. Most hunting trips are planned in spring and the onset of autumn, from February through April and August through October respectively.&lt;/p&gt;\r\n\r\n&lt;p&gt;Dhorpatan is a 4-day trek from Baglung which is 72 km from Pokhara. Accommodation facilities include tented camps or a village house.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Jungle safari&lt;a href=&quot;\\&quot;&gt;&lt;img alt=&quot;\\&quot;Mountain-biking-in-nepal\\&quot;&quot; src=&quot;\\&quot; style=&quot;\\&quot;height:350px&quot; /&gt;&lt;/a&gt;&lt;/strong&gt;&lt;br /&gt;\r\nNepal&rsquo;s diverse terrain makes it one of the best for mountain biking. Bike through the country and discover villages and small towns in the midst of rural serenity. Time permitting; it is even possible to explore the entire length and breadth of the country on a mountain bike. Bikes can be hired in Kathmandu and Pokhara.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Mountain Flights&lt;/strong&gt;&lt;br /&gt;\r\n&lt;strong&gt;&lt;a href=&quot;\\&quot;&gt;&lt;img alt=&quot;\\&quot;entertainment\\&quot;&quot; src=&quot;\\&quot; style=&quot;\\&quot;height:350px&quot; /&gt;&lt;/a&gt;&lt;/strong&gt;&lt;br /&gt;\r\nKathmandu, which is generally a quiet city after twilight, bustles with life till the wee hours of the morning in the narrow alleys of Thamel and other selected places. Bars and pubs, many of which feature live music, stay open till late night while discotheques function to keep boredom at bay for the young Nepali crowd and tourists out for the night. Frequent private parties are also organized at various places especially during weekends and public holidays&nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Paragliding&lt;a href=&quot;\\&quot;&gt;&lt;img alt=&quot;\\&amp;quot;paragliding-in-nepal\\&amp;quot;&quot; data-cke-saved-src=&quot;\\&quot; src=&quot;\\&amp;quot;file:///C:/Users/KrishnaP/AppData/Local/Temp/msohtmlclip1/01/clip_image015.jpg\\&amp;quot;&quot; style=&quot;\\&amp;quot;height:350px;&quot; width:350px\\&quot;=&quot;&quot;&gt;&lt;/a&gt;&lt;/strong&gt;&lt;br /&gt;\r\nParagliding is a relatively new adventure sport in Nepal, and is the simplest, safest and least expensive way of discovering the joys of flying alone to experience the aerial views of the magnificent Himalayas. Sarangkot, at 1,592 m above Lakeside in Pokhara Valley, is the jumping off point for paragliders. From here, one can take in stunning views of three of the world&rsquo;s Eight Thousanders, namely, Dhaulagiri, Annapurna and Manaslu.&lt;/p&gt;\r\n','Dear Travellers','Dear Travellers','Dear Travellers','2014-08-21 08:58:02','2014-11-04 11:10:11'),(5,103,'Blood Donation Programme','blood-donation-programme','&lt;p&gt;Black Eye Journeys Pvt.Ltd , being a responsible travel agency is organising the blood donation programme in the very Ist day of very new year 2015. We would like to invite all the responsible citizen to donate the blood for very good cause.&lt;/p&gt;\r\n\r\n&lt;p&gt;The details of the venue will released very soon....&lt;/p&gt;\r\n','','','','2014-11-04 11:42:15','2014-11-04 11:42:15'),(6,103,'Donate Blood for the Cause','donate-blood-for-the-cause','&lt;p&gt;Black Eye Journeys is organising the blood donation programme very soon...&nbsp;&lt;/p&gt;\r\n','','','','2014-11-04 11:47:39','2014-11-04 11:47:39');
