 corporate and business people to enjoy their vacation as well as perorm their business activites as well at the same time. International Club is serving to its clients from nation and in international market since 2006.&lt;/p&gt;\r\n','1414578882-h1YmaoSyFKnUOBP0UTO1.jpg','1414578882-h1YmaoSyFKnUOBP0UTO1_thumb.jpg',1295,0,'&lt;p&gt;If the booking is done for the business cum vacation purpose the 75% of the payment should be made at the time of booking confirmation and rest within the check out date.&lt;/p&gt;\r\n\r\n&lt;p&gt;If the booking is done for the personal vacation 50% payment should be made at a time of booking confirmation and rest within the check-out date.&lt;/p&gt;\r\n',151,'Kathmandu','Kathmandu',977,'International Club',1605,5,'Mountain View',25,0,'&lt;p&gt;Madhyapur, Thimi, Bhaktapur&lt;/p&gt;\r\n\r\n&lt;p&gt;Nepal&lt;/p&gt;\r\n',46,18,59,6,6,0,0,0,5,20,0,16,10,0,8,5,'International Club','',10,'2014-10-28 15:05:07','2014-12-31 00:00:00','','&lt;p&gt;All the modern facilities and amneties.&lt;/p&gt;\r\n\r\n&lt;p&gt;Private apartments.&lt;/p&gt;\r\n\r\n&lt;p&gt;Private Pubs&lt;/p&gt;\r\n\r\n&lt;p&gt;Sports&lt;/p&gt;\r\n\r\n&lt;p&gt;Indoor and Outdoor Swimming Pool.&lt;/p&gt;\r\n','&lt;p&gt;The booking Confirmation should be done before15 days of check in date . (Off Season)&lt;/p&gt;\r\n\r\n&lt;p&gt;The booking Confirmation should be done before 30days of Check in date. (Peak Season)&lt;/p&gt;\r\n\r\n&lt;p&gt;Booking confirmed by paying the price as per the policy made by the owner is only asured booking.&lt;/p&gt;\r\n\r\n&lt;p&gt;No changes in dates and other facilities will be assisted before 10 days of check-in.&lt;/p&gt;\r\n\r\n&lt;p&gt;All the requirements and facilities expected and demanded should be clarified during the recomfirmation of the booking.&lt;/p&gt;\r\n','&lt;p&gt;All the payment and taxes and charges should be made as per the policy and rules of Owner.&lt;/p&gt;\r\n\r\n&lt;p&gt;Owner only accept the payment in US$ . Other currency can also be accepted if the owner agrees.&lt;/p&gt;\r\n\r\n&lt;p&gt;Any damages and spoil of the property will lead toward the heavy and expensive charges.&lt;/p&gt;\r\n',15,8,14,'2014-10-29 10:34:42','2014-10-28 09:35:40');
